INSERT INTO `blog_article_models` VALUES (10, 'ATC-535BE9681', 'supresso.com', 'Blogpost', 2, 'ID', 'Post 1 Supresso : product 1', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.', 'Text', '<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>', 'content', 'asset/e7871df2e64de0c1aacfc7ef7ad4aa4e48ed7bcba850b4bb5e1651a8fa5c61a5.jpg', 'asset/0882de1e8308ca5c2c36f2dc81c2fc9f7e6a71b9b188fdc354468784ca71dd91.jpg', '2021-11-10 13:53:42', 'https://supresso.com/id/article/', '2021-10-08 00:00:00', '2021-10-15 23:59:00', 'SID-001', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (11, 'ATC-991BE9045', 'supresso.com', 'Blogpost', 2, 'ID', 'Post 1 Supresso : product 2', 'Contrary to popular belief, Lorem Ipsum is not simply random text.', 'HTML', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p><p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.', 'content', 'asset/8c6b1634648506fb19807bed28b5fb04798a2e41d71fdb58dedaa93ec625c504.jpg', 'asset/0882de1e8308ca5c2c36f2dc81c2fc9f7e6a71b9b188fdc354468784ca71dd911.jpg', '2021-11-10 13:56:45', 'https://supresso.com/id/article/', '2021-10-08 00:00:00', '2021-10-15 23:59:00', 'SID-001', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (12, 'ATC-203BE9533', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kisah-kisah masakan Nusantara', 'Oktober telah datang dan berlalu, dan November menunggu kita dengan tangan yang sudah terbuka.', 'HTML', 'Oktober telah datang dan berlalu, dan November menunggu kita dengan tangan yang sudah terbuka. Apa saja yang telah kita lakukan selama sebulan terakhir? Mari kita lihat semua menu yang telah terbuka melalui open PO, Dari kisah, signifikansi, fakta dan segala sesuatu tentangnya. Bersama-sama mari kita ikuti kisah kepulauan Indonesia, melalui makanan, bersama Pandan Garden.', 'header', 'asset/0a2472a74214d0580f827eb20e9303a2bbe5868310d5ee887803e8a1789851771.png', '', '2021-11-11 09:14:26', '', '2021-10-01 00:00:00', '2021-10-30 23:59:59', 'A1', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (13, 'ATC-334BE5810', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kisah-kisah masakan Nusantara (Footer)', 'Oktober telah datang dan berlalu, dan November menunggu kita dengan tangan yang sudah terbuka.', 'HTML', 'Temukan warisan kuliner Nusantara, temukan lebih banyak hal tentang Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea8120.jpg', '', '2021-11-11 09:17:24', '', '2021-10-01 00:00:00', '2021-10-30 23:59:59', 'A1', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (14, 'ATC-276BE2569', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Gila', 'Berkembang sejak era Kerajaan Sriwijaya sebelum masehi, nasi goreng dikenal menjadi makanan yang hampir populer di setiap daerah di Indonesia.', 'HTML', 'Berkembang sejak era Kerajaan Sriwijaya sebelum masehi, nasi goreng dikenal menjadi makanan yang hampir populer di setiap daerah di Indonesia. Pada masa itu, nasi goreng diperkenalkan oleh masyarakat Tionghoa yang notabene adalah para pedagang di tanah melayu.\r\n<br/><br/>\r\nSeiring berjalannya waktu, nasi goreng menjadi akrab di lidah masyarakat Indonesia melalui variasi tertentu sesuai selera daerah. Adapun Nasi Goreng Gila, masakan yang berasal dari Kota Jakarta, kami suguhkan secara hangat dan penuh kebanggaan untuk masyarakat Kota Surabaya.', 'content', 'asset/0a2472a74214d0580f827eb20e9303a2bbe5868310d5ee887803e8a178985177.png', '', '2021-11-11 09:33:22', '', '2021-10-01 00:00:00', '2021-10-30 23:59:59', 'A1', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (15, 'ATC-593BE6922', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Dory Salted Egg', 'Siapa yang tak kenal Dory? Teman yang menemani ikan kecil Nemo untuk mencari Ayahnya,, ups.. salah tempat cerita, hehe.', 'HTML', 'Siapa yang tak kenal Dory? Teman yang menemani ikan kecil Nemo untuk mencari Ayahnya,, ups.. salah tempat cerita, hehe. Dory adalah nama yang cukup populer di masyarakat Indonesia, tetapi tahukah anda kalau sebenarnya Dory hanyalah nama lain dari ikan Patin yang hidup di air tawar loh!\r\n<br/><br/>\r\nSelain banyak sebutan, ikan Dory/Patin juga menjadi bahan dasar berbagai masakan dari seluruh daerah di Indonesia! Nah, sekarang sudah tau kan asal-usul ikan Dory yang terkenal itu. Pandan Garden pun menyediakan Nasi Dory Salted Egg pada Open PO di minggu kedua bulan Oktober!', 'content', 'asset/139b255d5c695bb1ef00b6c40f1a63c5b4936d779ba2927f6d82f3842a2c45be.png', '', '2021-11-11 09:35:25', '', '2021-10-01 00:00:00', '2021-10-30 23:59:59', 'A1', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (16, 'ATC-258BE4977', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Krengsengan Ayam', 'Percampuran aneka bumbu yang meresap, aroma rempah yang kuat adalah bagaimana masakan khas Surabaya, Krengsengan dibuat.', 'HTML', 'Percampuran aneka bumbu yang meresap, aroma rempah yang kuat adalah bagaimana masakan khas Surabaya, Krengsengan dibuat. Masakan yang satu ini dikenal memiliki bahan dasar utama daging kambing yang dimasak bersama dengan rempah, kecap dan bumbu khusus sehingga berwarna dominan gelap.\r\n<br/><br/>\r\nNamun siapa sangka, kalau tak semua orang menyukai daging kambing dalam olahan masakan apapun, yang menyebabkan banyak kalangan enggan mera-sakan cita rasa sesungguhnya dari Krengsengan. Atas dasar itulah, Pandan Garden melalui menu PO Nasi Krengsengan Ayam, menggunakan daging ayam sebagai bahan dasar yang pasti banyak digemari masyarakat Surabaya!', 'content', 'asset/ba3dcc85b938c14733b7bc49e5b027048f4134f598d693d3194de5b194cae6a6.png', '', '2021-11-11 09:36:41', '', '2021-10-01 00:00:00', '2021-10-30 23:59:59', 'A1', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (17, 'ATC-261BE6041', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Serundeng', 'Sebuah rasa yang lezat mampu tercipta dari nasi, ayam goreng, serundeng, sambal tempe, sambal ijo, dan juga lalapan.', 'HTML', 'Sebuah rasa yang lezat mampu tercipta dari nasi, ayam goreng, serundeng, sambal tempe, sambal ijo, dan juga lalapan. Yup, Nasi Ayam Serundeng adalah menu PO periode akhir bulan Oktober.\r\n<br/><br/>\r\nMenu yang besar dan populer di Jawa Barat ini mempunyai daya tarik tersendiri, karena marinasi ayam yang khas dan bumbu yang tak biasa. Melalui renyah ayam goreng dan sedapnya serundeng, Pandan Garden menyediakan masakan khas bumi Pasundan di Kota Surabaya!', 'content', 'asset/2705b73a734da5f9452d797a5395cae23e207e90653e1e60716b16fe1c4b662c.png', '', '2021-11-11 09:38:03', '', '2021-10-01 00:00:00', '2021-10-30 23:59:59', 'A1', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (18, 'ATC-584BE3944', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Melalui menu spesial PO, kami bercerita', 'Daging ikan yang juicy nan lembut khas dory berpadu dengan gurihnya salted egg sauce Pandan Garden.', 'HTML', 'Daging ikan yang juicy nan lembut khas dory berpadu dengan gurihnya salted egg sauce Pandan Garden. Yuk ketahui lebih lanjut segala hal tentang ikan dory dan salted egg! ', 'header', 'asset/3768d8ff603ed284d12000493cd276fc8fe8305a843ddfd95b99ea608c49753e.png', '', '2021-11-18 16:24:16', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A2', 'Draft', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (19, 'ATC-830BE1626', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Melalui menu spesial PO, kami bercerita (Footer)', 'Belum kebagian menu minggu ini? Nantikan saja menu PO lainnya yang selalu tersedia untuk anda dengan home style cooking hanya di Pandan Garden.', 'HTML', 'Belum kebagian menu minggu ini? Nantikan saja menu PO lainnya yang selalu tersedia untuk anda dengan home style cooking hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81201.jpg', '', '2021-11-18 16:27:00', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A2', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (20, 'ATC-781BE7273', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Dory Salted Egg', 'Gimana, lezat dan kenyang kan Nasi Dory Salted Eggnya? Ada pepatah Surabaya mengatakan, saat harga test PCR tak kunjung terkendali, menu PO lah yang akan menempati isi hati,, hehehe.', 'HTML', 'Gurih yang sempurna, saat ikan dory dibaluri tepung crispy, kemudian digoreng dengan kematangan yang pas. Setelah penggorengan, salted egg dituangkan merata mengisi celah-celah crispy yang menggugah selera.\r\n<br/><br/>\r\nTentang ikan dory, memang tak mudah ditemukan di pasaran namun banyak jenis-jenis ikan yang secara rasa hampir mirip dan mudah didapatkan, seperti patin, gabus, lele, dan gindara. Sedangkan salted egg sauce yang fenomenal bisa diperoleh dengan menghaluskan kuning telur asin bebek, lalu diberi bumbu dapur, kemudian dimasak bersama dengan mentega dan bawang putih. Mungkin siapa saja bisa membuatnya, tetapi alangkah baiknya tak usah ambil pusing, pesan saja secara mudah menu yang siap saji dengan rasa dan porsi yang mantap seperti Nasi Dory Salted Egg.', 'content', 'asset/3768d8ff603ed284d12000493cd276fc8fe8305a843ddfd95b99ea608c49753e1.png', '', '2021-11-18 16:29:36', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A2', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (22, 'ATC-639BE1971', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rendang, olahan daging berbalut bumbu rempah', 'Siapa yang belum mengenal rendang? Makanan terkenal sejuta umat yang sempat ramai diperbincangkan karena kelezatannya oleh sang juri Master Chef dunia, Gordon Ramsay.', 'HTML', 'Siapa yang belum mengenal rendang? Makanan terkenal sejuta umat yang sempat ramai diperbincangkan karena kelezatannya oleh sang juri Master Chef dunia, Gordon Ramsay. Mari mengenal lebih jauh tentang rendang melalui Main Menu Pandan Garden, Nasi Rendang Daging!', 'header', 'asset/a3c90380155c3bbb20e64bb8bd762321c4a2a616714e2571347688c8fa20d0e4.png', '', '2021-11-25 11:28:35', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A3', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (23, 'ATC-572BE9137', 'pandangarden.com', 'Blogpost', 3, 'EN', 'Nasi Rendang Daging', 'Seberapa sering anda menjumpai masakan rendang yang bervariasi? Yup, tentu sering dan hampir mudah ditemui. Masakan yang fenomenal karena kelezatannya ini merupakan warisan asli Nusantara yang memiliki ciri khas daging berwarna cokelat gelap dengan tekstur rempah yang menggiurkan.', 'HTML', 'Seberapa sering anda menjumpai masakan rendang yang bervariasi? Yup, tentu sering dan hampir mudah ditemui. Masakan yang fenomenal karena kelezatannya ini merupakan warisan asli Nusantara yang memiliki ciri khas daging berwarna cokelat gelap dengan tekstur rempah yang menggiurkan.\r\n<br/><br/>\r\nResep otentik yang menjadi penentu rasa adalah pada santan, kapulaga, kayumanis dan beberapa rempah pendukung lainnya! Tak heran, aroma yang dihasilkan pun harum wangi penuh kelezatan. Nasi Rendang Daging di Pandan Garden, memiliki keseluruhan citarasa sesungguhnya dari rendang. Saat memesannya, anda akan mendapatkan rendang berbalut bumbu rempah kental beserta daun singkong, acar pelengkap dan tak lupa sambal hijau!', 'content', 'asset/a3c90380155c3bbb20e64bb8bd762321c4a2a616714e2571347688c8fa20d0e41.png', '', '2021-11-25 11:44:06', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A3', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (24, 'ATC-300BE1463', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rendang, olahan daging berbalut bumbu rempah. (Footer)', 'Menggiurkan ya? Langsung saja pesan menu Nasi Rendang Daging yang selalu tersedia kapan saja hanya di Pandan Garden!', 'HTML', 'Menggiurkan ya? Langsung saja pesan menu Nasi Rendang Daging yang selalu tersedia kapan saja hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81202.jpg', '', '2021-11-25 11:45:13', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A3', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (25, 'ATC-457BE9249', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Alasan mengapa menu spesial PO patut dicoba', 'Hari-hari berjalan, bulan silih berganti seiring terbitnya sinar matahari yang teriknya berseri. Saat mendengar kata November, yang teringat dalam benak kita pasti â€œakhir tahun sudah dekat!â€.', 'HTML', 'Hari-hari berjalan, bulan silih berganti seiring terbitnya sinar matahari yang teriknya berseri. Saat mendengar kata November, yang teringat dalam benak kita pasti â€œakhir tahun sudah dekat!â€. Namun perut lapar keroncongan tak kunjung mereda, tapi tenang itu bukan salah anda! Pandan Garden punya beragam menu PO yang super memuaskan. Yuk, simak apa saja menu yang bisa jadi pilihan anda nantinya melalui Wacana.', 'header', 'asset/f9184033321346eda2d8a6670fe6e72dc87d3e1a73a47450e7032854ec16a656.png', '', '2021-12-01 13:52:23', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A4', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (26, 'ATC-214BE9586', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Alasan mengapa menu spesial PO patut dicoba (Footer)', 'Belum kebagian menu minggu ini? Nantikan saja menu PO lainnya yang selalu tersedia untuk anda dengan home style cooking hanya di Pandan Garden.', 'HTML', 'Belum kebagian menu minggu ini? Nantikan saja menu PO lainnya yang selalu tersedia untuk anda dengan home style cooking hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81203.jpg', '', '2021-12-01 13:55:28', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A4', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (27, 'ATC-112BE8459', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Geprek', 'Menu yang terkenal karena sambal bawangnya yang sedap dan pedas nampol ini telah sukses memanaskan semangat di awal bulan November! Dari banyak menu PO yang unik, Nasi Ayam Geprek memfokuskan diri pada ayam goreng tepung yang renyah serta sambal bawang yang mantap. ', 'HTML', 'Menu yang terkenal karena sambal bawangnya yang sedap dan pedas nampol ini telah sukses memanaskan semangat di awal bulan November! Dari banyak menu PO yang unik, Nasi Ayam Geprek memfokuskan diri pada ayam goreng tepung yang renyah serta sambal bawang yang mantap. Untuk menciptakan rasa ayam goreng tepung yang lezat dan renyah, koki Pandan Garden memarinasi ayam potong terlebih dahulu dengan bumbu khas Nusantara kemudian melumuri seluruh bagiannya dengan tepung berbumbu.\r\n<br/><br/>\r\nSedangkan sambal bawangnya, cukup dengan cabai rawit, bawang putih dan bahan-bahan pendukung lain untuk memperoleh rasa pedas yang pas! Boleh banget dicoba nanti saat jadwal menu PO Nasi Ayam Geprek sudah dibuka.', 'content', 'asset/f9184033321346eda2d8a6670fe6e72dc87d3e1a73a47450e7032854ec16a6561.png', '', '2021-12-01 13:57:24', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A4', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (28, 'ATC-825BE4982', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Gila', 'Bulan Oktober lalu sudah paham kan mengenai asal usul Nasi Goreng Gila? Kalau belum coba cek artikel sebelumnya! Menu yang populer di Jakarta ini memiliki tampilan dan rasa yang berbeda dari nasi goreng pada umumnya.', 'HTML', 'Sudah paham kan mengenai asal usul Nasi Goreng Gila di artikel bulan lalu? Kalau belum coba cek artikel sebelumnya! Menu yang populer di Jakarta ini memiliki tampilan dan rasa yang berbeda dari nasi goreng pada umumnya. Sesuai dengan namanya, Nasi Goreng Gila memiliki porsi yang cukup mengenyangkan dengan aneka isian plus krupuk renyah nan gurih.\r\n<br/><br/>\r\nPertama-tama nasi disiapkan, lalu dimasukkan ke dalam bumbu-bumbu khas Nusantara, dan ditumis bersamaan secara konsisten dengan kematangan yang sempurna. Kemudian dihidangkan dan dimakan dengan hati yang riang gembira. Sangat wajib anda coba saat menu PO ini sudah dibuka!', 'content', 'asset/224bc140f6f6ad12eb4ca337e9add0466533c0825ee4afcaa280fa345ef88607.png', '', '2021-12-01 13:58:34', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A4', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (29, 'ATC-347BE1489', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Dory Salted Egg', 'Tentang ikan dory, memang tak mudah ditemukan di pasaran namun banyak jenis-jenis ikan yang secara rasa hampir mirip dan mudah didapatkan, seperti patin, gabus, lele, dan gindara.', 'HTML', 'Tentang ikan dory, memang tak mudah ditemukan di pasaran namun banyak jenis-jenis ikan yang secara rasa hampir mirip dan mudah didapatkan, seperti patin, gabus, lele, dan gindara. Sedangkan salted egg sauce yang fenomenal bisa diperoleh dengan menghaluskan kuning telur asin bebek, lalu diberi bumbu dapur, kemudian dimasak bersama dengan mentega dan bawang putih.\r\n<br/><br/>\r\nMungkin siapa saja bisa membuatnya, tetapi alangkah baiknya tak usah ambil pusing, pesan saja secara mudah menu yang siap saji dengan rasa dan porsi yang mantap seperti Nasi Dory Salted Egg.', 'content', 'asset/f078b21fb5417c5975854dde2f9fc63988b019178c5dafb5e825890a72ab2d12.png', '', '2021-12-01 14:05:33', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A4', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (30, 'ATC-906BE6710', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Kare Ayam', 'Menu ini bisa jadi pantas dinobatkan sebagai menu PO yang memiliki kadar rempah pekat khas Nusantara tertinggi di antara menu-menu lainnya.', 'HTML', 'Menu ini bisa jadi pantas dinobatkan sebagai menu PO yang memiliki kadar rempah pekat khas Nusantara tertinggi di antara menu-menu lainnya. Betapa tidak? Bumbu kare yang terdiri dari santan, serai, lengkuas, daun salam, daun jeruk dan masih banyak lagi rempah penting yang harus menjadi resep utama untuk membuatnya. Proses memasaknya pun cukup memakan waktu, karena ayam potong yang sebelumnya telah disiapkan haruslah mengalami proses perebusan bersamaan dengan bumbu rempah komplit.\r\n<br/><br/>\r\nCara menyajikan Nasi Kare Ayam pun bisa disertai dengan berbagai macam lauk lain atau beberapa sayur-sayuran pendukung dan yang pasti, anda harus mencoba menu yang satu ini untuk mengetahui rasa sesungguhnya dari kare.', 'content', 'asset/c9f979b394019711b75dc282bda8ed4d40c018a1c6a5098bf9f57dc3e4a27d0b.png', '', '2021-12-01 14:08:21', '', '2021-11-01 00:00:00', '2021-11-30 23:59:00', 'A4', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (31, 'ATC-216BE1350', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Telusuri asal-usul lezatnya Mie Ayam Jamur', 'Pencinta mie ayam wajib banget tau informasi penting mengenai asal-usulnya!', 'HTML', 'Pencinta mie ayam wajib banget tau informasi penting mengenai asal-usulnya! Sebelum memulai untuk eksplorasi rasa otentik dari semangkuk mie ayam, sangat disarankan untuk membaca ulasan terkait Mie Ayam Jamur terlebih dahulu.', 'header', 'asset/79ee0a51b309ecb9c9d7e7600a3f0199a5a75d0ae689026b408c97b2fa65fe8e.png', '', '2021-12-08 14:17:18', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A5', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (32, 'ATC-832BE6555', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Telusuri asal-usul lezatnya Mie Ayam Jamur (Footer)', 'Belum pernah coba?', 'HTML', 'Belum pernah coba? Segera pesan Mie Ayam Jamur yang selalu tersedia kapan saja hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81204.jpg', '', '2021-12-08 14:18:44', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A5', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (33, 'ATC-512BE9559', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Mie Ayam Jamur', 'Sering menjumpai adegan makan mie di film-film nuansa negara panda ya? Nah, makanan lezat dengan tekstur gurih, sedikit kenyal, serta panjang dengan berbagai macam isian ini sebenarnya berasal dari Tiongkok loh!', 'HTML', 'Sering menjumpai adegan makan mie di film-film nuansa negara panda ya? Nah, makanan lezat dengan tekstur gurih, sedikit kenyal, serta panjang dengan berbagai macam isian ini sebenarnya berasal dari Tiongkok loh! Walaupun demikian, mie ayam telah tersebar dengan berbagai variasi di seluruh penjuru Indonesia!\r\n<br/><br/>\r\nMie ayam di Nusantara tentunya punya ciri khas masing-masing tentang tampilan, tekstur, juga perihal rasa yang disuguhkan. Seperti Mie Ayam Jamur punya Pandan Garden yang satu ini, dari tekstur, bumbu, dan isiannya pun punya ciri khasnya. Ada mie yang gurih nan kenyal berwarna hijau, ada ayam dan jamur yang super-duper lezat yang pasti tak terkalahkan. Kombinasi yang sangat memuaskan ini akan membuat hari-hari anda lebih mengenyangkan!', 'content', 'asset/79ee0a51b309ecb9c9d7e7600a3f0199a5a75d0ae689026b408c97b2fa65fe8e1.png', '', '2021-12-08 14:22:05', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A5', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (34, 'ATC-436BE6341', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bubur Ayam, makanan idola semua kalangan', 'Hayo,, kali ini semua kubu penggemar Bubur Ayam harus merapatkan barisan sejenak untuk membaca ulasan tentang makanan yang fenomenal ini.', 'HTML', 'Hayo,, kali ini semua kubu penggemar Bubur Ayam harus merapatkan barisan sejenak untuk membaca ulasan tentang makanan yang fenomenal ini. Semua orang pasti sudah tau kalau Bubur Ayam adalah makanan yang paling populer di antara masakan Nusantara lainnya.', 'header', 'asset/c62d908009a9da6c305a61eea441cb05fd93582f315e754c8304a596e32e0cf7.png', '', '2021-12-16 10:33:37', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A6', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (35, 'ATC-417BE3783', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bubur Ayam, makanan idola semua kalangan (Footer)', 'Tergiur kan? Pesan Bubur Ayam sekarang hanya di Pandan Garden!', 'HTML', 'Tergiur kan? Pesan Bubur Ayam sekarang hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81205.jpg', '', '2021-12-16 10:35:37', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A6', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (36, 'ATC-781BE8283', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bubur Ayam', 'Di seluruh dunia barat, bubur dibagi menjadi dua jenis yaitu bubur yang terbuat dari oat atau kacang-kacangan lainnya dan bubur yang terbuat dari bahan dasar beras atau nasi.', 'HTML', 'Di seluruh dunia barat, bubur dibagi menjadi dua jenis yaitu bubur yang terbuat dari oat atau kacang-kacangan lainnya dan bubur yang terbuat dari bahan dasar beras atau nasi. Mulanya, resep Bubur Ayam dipercaya ditemukan pertama kalinya di daratan China.\r\n<br/><br/>\r\nBubur Ayam memiliki tekstur lembut nan creamy yang bisa membuat siapapun jatuh cinta! Sedapnya rasa bubur berasal dari beras yang pulen, garam dan bumbu lain yang cukup serta cara memasaknya yang relatif menggunakan api kecil atau sedang. Kuah bubur yang tasty juga dihasilkan dari kualitas daging ayam yang mengeluarkan kaldu super lezat. Isian seperti ayam, kacang goreng, krupuk dan isian lainnya pun tak kalah gurihnya saat dipadukan dengan sedapnya kuah serta bubur. Karena proses yang sedikit susah dan penuh kesabaran, anda bisa memperoleh rasa sesungguhnya dari Bubur Ayam langsung di Pandan Garden!', 'content', 'asset/c62d908009a9da6c305a61eea441cb05fd93582f315e754c8304a596e32e0cf71.png', '', '2021-12-16 10:36:46', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A6', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (37, 'ATC-681BE2868', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Alternatif selera untuk meraih kenyang, Nasi Merah Komplit', 'Halo pembaca setia! Karena artikel ini terbit saat Natal, maka Pandan Garden mengucapkan Selamat Merayakan Hari Natal untuk semuanya! ', 'HTML', 'Halo pembaca setia! Karena artikel ini terbit saat Natal, maka Pandan Garden mengucapkan Selamat Merayakan Hari Natal untuk semuanya! Tanpa menunggu, langsung saja menuju topik yang harus diketahui oleh semua orang yakni Nasi Merah Komplit!', 'header', 'asset/599dab9ba176361878f824983c8e94e525fda317e773c70c83ef2ca7fc840f8a.png', '', '2021-12-22 16:45:42', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A7', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (38, 'ATC-363BE7364', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Alternatif selera untuk meraih kenyang, Nasi Merah Komplit (Footer)', 'Sudah masuk list makanan yang must-try hari ini? Pesan Nasi Merah Komplit sekarang hanya di Pandan Garden!', 'HTML', 'Sudahkah masuk di list makanan yang must-try hari ini? Pesan Nasi Merah Komplit sekarang hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81206.jpg', '', '2021-12-22 16:46:51', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A7', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (39, 'ATC-446BE9107', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Merah Komplit', 'Dikenal karena warna merah asli yang dihasilkan dari beras merah, nasi merah namanya. Salah satu makanan khas Nusantara yang dipercaya memiliki kandungan serat yang tinggi, baik untuk mengontrol kandungan gula dalam tubuh, serta masih banyak lagi puluhan manfaat lainnya.', 'HTML', 'Dikenal karena warna merah asli yang dihasilkan dari beras merah, nasi merah namanya. Salah satu makanan khas Nusantara yang dipercaya memiliki kandungan serat yang tinggi, baik untuk mengontrol kandungan gula dalam tubuh, serta masih banyak lagi puluhan manfaat lainnya. \r\n<br/><br/>\r\nBeras merah didapatkan dari proses pengelupasan kulit biji-bijian beras yang disebut sebagai sekam. Karena pengolahan beras yang relatif lebih singkat, menjadikan beras merah memiliki tekstur unik serta manfaat yang lebih banyak dibandingkan dengan beras putih. Tips memasak nasi merah adalah jangan biarkan ia terlalu lama berada pada suhu ruangan, dikarenakan nasi merah lebih cepat mengeras. Karena cara memasak dan pengolahan yang cukup rumit, Pandan Garden menyarankan anda untuk mencoba Nasi Merah Komplit yang bisa dipesan kapan saja! Isian yang lengkap dari aneka ragam lauk, sayur, dan item penambah selera lainnya! ', 'content', 'asset/599dab9ba176361878f824983c8e94e525fda317e773c70c83ef2ca7fc840f8a1.png', '', '2021-12-22 16:49:14', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A7', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (40, 'ATC-193BE9830', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bulan dan tahun silih berganti, menu spesial PO tetap di hati!', 'Tak terasa tahun 2021 tinggal beberapa jam lagi. Namun apa daya, kehidupan harus bergerak menuju hari-hari baru yang penuh tantangan.', 'HTML', 'Tak terasa tahun 2021 tinggal beberapa jam lagi. Namun apa daya, kehidupan harus bergerak menuju hari-hari baru yang penuh tantangan. Walaupun demikian, percayalah tahun depan akan menjadikan anda semakin bersinar terang! Pandan Garden mengajak seluruh pembaca untuk mengenal lebih jauh tentang potensi diri melalui citarasa masakan khas Nusantara.', 'header', 'asset/aa09cfbc993dfe0d34fc8e864b10d7ec4862cf24e973eaea66cbbf1b8861aed8.png', '', '2021-12-29 16:40:49', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A8', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (41, 'ATC-956BE4541', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bulan dan tahun silih berganti, menu spesial PO tetap di hati! (Footer)', 'Tergiur beberapa menu spesial POnya ya? Nantikan menu PO lainnya yang selalu tersedia spesial untuk anda hanya di Pandan Garden.', 'HTML', 'Tergiur beberapa menu spesial POnya ya? Nantikan menu PO lainnya yang selalu tersedia spesial untuk anda hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81207.jpg', '', '2021-12-29 16:51:16', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A8', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (42, 'ATC-767BE4786', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Bakar Madu', 'Ayam bakar, salah satu menu yang menjadi incaran penggemar masakan berbahan ayam.', 'HTML', 'Ayam bakar, salah satu menu yang menjadi incaran penggemar masakan berbahan ayam. Masakan yang identik dengan makanan wajib saat syukuran ini punya penggemar yang cukup banyak dari berbagai kalangan di Indonesia. Ayam bakar datang dengan dibaluri beraneka ragam bahan lain seperti kecap, pedas, balado, madu, dan masih banyak lainnya. Para pembaca pasti punya selera tersendiri mengenai variasi dari ayam bakar.\r\n<br/><br/>\r\nDi menu spesial PO Pandan Garden, juga menyediakan Nasi Ayam Bakar Madu yang tak kalah â€œwajibâ€ untuk dicoba para pembaca sekalian! Tunggu jadwalnya datang, lalu jangan lupa dipesan~', 'content', 'asset/aa09cfbc993dfe0d34fc8e864b10d7ec4862cf24e973eaea66cbbf1b8861aed81.png', '', '2021-12-30 08:34:11', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A8', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (43, 'ATC-266BE7941', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Goreng Kalasan', 'Kalasan, kalasan, kalasan. Tak henti-hentinya ia bertebaran dan menjadi idaman para pencari rasa kenyang.', 'HTML', 'Kalasan, kalasan, kalasan. Tak henti-hentinya ia bertebaran dan menjadi idaman para pencari rasa kenyang. Kombinasi nama ayam goreng dan kalasan sepertinya sudah melekat cukup kuat serta mustahil untuk dipisahkan. Konon katanya, siapapun yang mencoba satu gigitan, niscaya datang suatu mukjizat rasa ketagihan! Apalagi dengan isian yang bervariasi, rasa yang tak tertandingi dan lezatnya ayam goreng yang sudah pasti gurih.\r\n<br/><br/>\r\nBerbagai bahan dasar, langkah-langkah memasak, dan penyajiannya pun berteberan di mana-mana dan bisa langsung dilihat di berbagai kanal YouTube, Instagram, Facebook, serta TikTok. Namun agar tidak kesusahan, pesan saja Nasi Ayam Goreng Kalasan yang menjadi salah satu menu spesial PO di Pandan Garden.', 'content', 'asset/e0755ce3acbf1edd128c58f237fa6911746e5d638b97911d46c4f313704f3e8e.png', '', '2021-12-30 08:35:30', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A8', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (44, 'ATC-637BE9887', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Krengsengan Ayam', 'Diolah dari ayam, warisan kuliner Nusantara krengsengan di Pandan Garden pun memiliki keunikannya tersendiri.', 'HTML', 'Diolah dari ayam, warisan kuliner Nusantara krengsengan di Pandan Garden pun memiliki keunikannya tersendiri. Betapa tidak, jika biasanya krengsengan memiliki bahan dasar daging kambing atau sapi. Pandan Garden mereposisi kedudukan daging-daging tersebut dengan ayam! Karena memiliki banyak penggemar, warga Surabaya agaknya punya standar selera yang tinggi pada masakan krengsengan dan mengakibatkan menu PO yang satu ini selalu habis tak tersisa.\r\n<br/><br/>\r\nBagi yang belum mencoba, kami sarankan agar segera memesannya saat jadwal Nasi Krengsengan Ayam sudah tersedia ya! ', 'content', 'asset/b86b53f5dc135323b6c4e2e8ba8c7e49672ebbe21691570c171b882a2024bad6.png', '', '2021-12-30 08:36:47', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A8', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (45, 'ATC-922BE1154', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Bali', 'Pandan Garden selalu punya cara tersendiri untuk memberikan performa terbaik menghadapi derasnya permintaan kuliner variatif dari para pencinta masakan Nusantara.', 'HTML', 'Pandan Garden selalu punya cara tersendiri untuk memberikan performa terbaik menghadapi derasnya permintaan kuliner variatif dari para pencinta masakan Nusantara. Salah satunya adalah mengangkat tema pulau Dewata yang terkenal dengan tanah surga, untuk dijadikan salah satu menu andalan yang bernama Nasi Goreng Bali ini! Sambal, isian, serta rasa yang dihasilkan pun melekat dengan aroma harum dari Bali!\r\n<br/><br/>\r\nSebenarnya anda juga bisa menemukan banyak masakan nasi goreng di luar sana, namun apakah anda yakin kalau sudah mencoba nasi goreng dengan nuansa Bali yang sempurna ini? Jangan sampai kelewatan! Pantau terus hadirnya menu spesial PO Nasi Goreng Bali!', 'content', 'asset/4d8e98be53b6c3eb145f22bc91d47680f2597dc6c8542e760815aaac17e93375.png', '', '2021-12-30 08:38:09', '', '2021-12-01 00:00:00', '2021-12-31 23:59:00', 'A8', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (46, 'ATC-904BE5569', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Selamat datang di dunia masakan berkuah gelap, Rawon!', 'Indonesia memang punya segunung resep masakan yang diwariskan turun-temurun.', 'HTML', 'Indonesia memang punya segunung resep masakan yang diwariskan turun-temurun. Tak terkecuali Rawon, masakan yang memiliki warna cokelat gelap pada kuahnya ini pun merupakan kuliner yang dipercaya telah ada ribuan tahun di Indonesia, tepatnya di Jawa Timur! Pada Wacana kali ini, kami mengajak para pembaca untuk menelisik sejarah sebenarnya dari Rawon.', 'header', 'asset/39eda83dec8f0291d3599f60325ce4ff5725b5c2af2a7dc9e23ed3b98b0551b7.png', '', '2022-01-06 15:47:31', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A9', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (47, 'ATC-946BE3611', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Selamat datang di dunia masakan berkuah gelap, Rawon! (Footer)', 'Jika belum, pesan Nasi Rawon Daging sekarang hanya di Pandan Garden!', 'HTML', 'Jika belum, pesan Nasi Rawon Daging sekarang hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81208.jpg', '', '2022-01-06 15:48:47', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A9', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (48, 'ATC-237BE7783', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Rawon Daging', 'Jawa Timur menjadi tempat lahirnya Rawon di Indonesia. Sebelum menyebar ke banyak daerah lainnya, terdapat sebuah temuan yang cukup mencengangkan tentang umur sebenarnya dari Rawon.', 'HTML', 'Jawa Timur menjadi tempat lahirnya Rawon di Indonesia. Sebelum menyebar ke banyak daerah lainnya, terdapat sebuah temuan yang cukup mencengangkan tentang umur sebenarnya dari Rawon. Temuan tersebut adalah Prasasti Taji di Ponorogo, Prasasti berbentuk lempeng dari tembaga tersebut telah diteliti dan bertuliskan berbagai nama masakan yang salah satunya bernama Rarawwan. Yup, itu adalah Rawon, kuah kental beserta daging sapi yang kita kenal hingga saat ini.\r\n<br/><br/>\r\nBegitu hebatnya leluhur kita membuat masakan yang kaya akan rasa dan menggugah selera. Tetapi pernahkah kita bertanya tentang apa yang membuat Rawon memiliki warna cokelat gelap? Nah, warna gelap tersebut berasal dari rempah yang bernama kepayang atau biasa dikenal sebagai kluwek. Melalui pencampuran bumbu tertentu membuat rasa dari Rawon menjadi khas dengan tampilan yang menarik. Sudah pernahkah anda mencoba memasak Rawon?', 'content', 'asset/39eda83dec8f0291d3599f60325ce4ff5725b5c2af2a7dc9e23ed3b98b0551b71.png', '', '2022-01-06 15:50:06', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A9', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (49, 'ATC-544BE1092', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rice bowl, makanan yang wajib dibawa saat bepergian di akhir pekan!', 'Memasuki akhir pekan, rencana perjalanan pun sudah ditentukan.', 'HTML', 'Memasuki akhir pekan, rencana perjalanan pun sudah ditentukan. Dari banyaknya tujuan, ada satu hal yang terkadang mengganjal dan dialami hampir semua orang. â€œMau bawa bekal apa nih kali ini.. :(â€œ adalah ungkapan yang sering dikeluhkan oleh para pencinta traveling. Kami ingin sedikit membocorkan rahasia tentang bekal/makanan yang pas untuk membuat weekend para pembaca lebih menyenangkan! ', 'header', 'asset/97e116ac464bba4c0796b228873f01b8a3be64cae0e400dd24400f9249ff40f5.png', '', '2022-01-13 16:09:22', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A10', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (50, 'ATC-411BE5732', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rice bowl, makanan yang wajib dibawa saat bepergian di akhir pekan! (Footer)', 'Pilih satu atau semua menu Rice bowl sekarang hanya di Pandan Garden!', 'HTML', 'Pilih satu atau semua menu Rice bowl sekarang hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea81209.jpg', '', '2022-01-13 16:10:19', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A10', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (51, 'ATC-952BE7116', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rice Bowl', 'Nasi di dalam mangkuk atau biasa disebut dengan Rice bowl adalah menu yang populer karena keunikan dan kepraktisannya.', 'HTML', 'Nasi di dalam mangkuk atau biasa disebut dengan Rice bowl adalah menu yang populer karena keunikan dan kepraktisannya. Rice bowl memiliki beragam variasi dan citarasa yang membuatnya dipercaya sebagai penyelamat di kala datang rasa lapar. Porsi yang pas, lauk yang bermacam-macam, isian yang lengkap dan segudang lagi kelebihan yang dimiliki oleh semangkuk penuh kelezatan ini.\r\n<br/><br/>\r\nMenariknya, banyak orang belum mengetahui bagaimana memilih menu Rice bowl yang cocok dibawa untuk bepergian saat akhir pekan. Nah, pada kesempatan ini Pandan Garden punya menu khusus berkategori Rice bowl yang senantiasa tersedia untuk siapa saja. Ada Nasi Goreng Soto, Nasi Goreng Rawon, Nasi Dory Sambal Matah, dan Nasi Ayam Teriyaki. Tinggal dipilih mana yang paling pas untuk menemani perjalanan para pembaca sekalian. Tips dari kami, Nasi Ayam Teriyaki untuk sarapan, Nasi Ayam Teriyaki untuk siang dan sore hari, lalu Nasi Goreng Rawon/Soto yang mantap untuk malam hari!', 'content', 'asset/97e116ac464bba4c0796b228873f01b8a3be64cae0e400dd24400f9249ff40f51.png', '', '2022-01-13 16:14:14', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A10', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (52, 'ATC-865BE6015', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Snacks yang â€œharus adaâ€ banget saat nonton drama Korea', 'Young Lady and Gentleman, Now, We Are Breaking Up, Moonshine, dan masih banyak drakor atau drama Korea lainnya yang sedang nge-hits pada tahun 2022 kali ini! ', 'HTML', 'Young Lady and Gentleman, Now, We Are Breaking Up, Moonshine, dan masih banyak drakor atau drama Korea lainnya yang sedang nge-hits pada tahun 2022 kali ini! Tentunya para pembaca setia Wacana sudah pada nonton ya.. hayo?? Melalui artikel kali ini, Pandan Garden ingin memperkenalkan Snacks yang wajib tersedia saat datang agenda nonton drama Korea!', 'header', 'asset/0dd220e9b02a5ce5cb09d0c4f4279aa04241523203410435a6458faf233ab7a8.png', '', '2022-01-19 11:21:34', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A11', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (53, 'ATC-821BE6162', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Snacks yang â€œharus adaâ€ banget saat nonton drama Korea (Footer)', 'Beli Snacks-nya sekarang hanya di Pandan Garden!', 'HTML', 'Beli Snacks-nya sekarang hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812010.jpg', '', '2022-01-19 11:23:58', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A11', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (54, 'ATC-458BE1688', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Snacks', 'Siang selalu punya matahari dan malam selalu punya rembulan, seperti itu pula agenda para pembaca Wacana kali ini.', 'HTML', 'Siang selalu punya matahari dan malam selalu punya rembulan, seperti itu pula agenda para pembaca Wacana kali ini. Kalau ada film/drama/movie maka harus ada pula beragam Snacks yang harus selalu menemani! Apa sajakah itu? Mereka bernama Lumpia Goreng, Risoles Mayo Smoked Beef, Kroket Ayam, Risoles Ayam, dan juga Pastel!\r\n<br/><br/>\r\nRasa sesungguhnya dari Snacks khas Nusantara akan lebih terasa saat dipadukan dengan nonton drakor kesukaan. Contohnya si Lumpia Goreng, kerenyahan dan melimpahnya isian di dalamnya mencerminkan kepintaran Park Dan Dan saat merawat ketiga anak dari Lee Young Guk! Atau si Risoles Mayo Smoked Beef, dengan mantapnya isian daging sapi asap di setiap gigitannya membuatnya menjalin <i>chemistry</i> dengan lidah kita seperti Hyeri dan Yoo Seung Ho. Tunggu apa lagi, eksplor semua Snacks di Pandan Garden saat nonton filmnya nanti!', 'content', 'asset/0dd220e9b02a5ce5cb09d0c4f4279aa04241523203410435a6458faf233ab7a81.png', '', '2022-01-19 11:27:23', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A11', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (55, 'ATC-566BE2741', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Mari kita panggil semua penyelamat di akhir pekan, menu spesial PO!', 'Bawang putih, bawang merah, cabai rawit, dan masih banyak rempah lainnya yang merupakan bahan dasar atau bumbu asli untuk membuat masakan khas Nusantara! Setiap bahan tentunya memiliki keunggulan, keunikan dan sisi lain yang membuatnya berbeda.', 'HTML', 'Bawang putih, bawang merah, cabai rawit, dan masih banyak rempah lainnya yang merupakan bahan dasar atau bumbu asli untuk membuat masakan khas Nusantara! Setiap bahan tentunya memiliki keunggulan, keunikan dan sisi lain yang membuatnya berbeda. Ada yang mungkin cocok di makan saat hujan, saat menanti sore, sarapan, sampai dengan segala macam acara khusus atau hari-hari besar yang akan datang! Tanpa perlu diperdebatkan, mari meninjau lebih lanjut tentang berbagai kreasi menu spesial PO yang selalu pas di segala situasi dan kondisi.', 'header', 'asset/c24d010ceea180d36d79c18255f21a902e6976b084d4d4989e3371c046e04cd5.png', '', '2022-01-19 11:30:11', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A12', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (56, 'ATC-875BE8757', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Mari kita panggil semua penyelamat di akhir pekan, menu spesial PO! (Footer)', 'Sudah tidak sabar menantikan menu PO selanjutnya? Ikuti terus update menu spesial PO untuk anda hanya di Pandan Garden.', 'HTML', 'Sudah tidak sabar menantikan menu PO selanjutnya? Ikuti terus update menu spesial PO untuk anda hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812011.jpg', '', '2022-01-19 11:30:59', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A12', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (57, 'ATC-684BE5744', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Geprek', 'Nasi Ayam Geprek, menu yang akrab dengan sebutan â€œrajanya sambal bawangâ€ ini menjadi menu pembuka awal tahun 2022! Rasa pedas yang mantap dan gurih ayam goreng tepung yang renyah sangat cocok untuk menggugah semangat di awal bulan yang penuh tantangan.', 'HTML', 'Nasi Ayam Geprek, menu yang akrab dengan sebutan â€œrajanya sambal bawangâ€ ini menjadi menu pembuka awal tahun 2022! Rasa pedas yang mantap dan gurih ayam goreng tepung yang renyah sangat cocok untuk menggugah semangat di awal bulan yang penuh tantangan. Melalui perpaduan antara porsi, isian dan sambal bawangnya, Nasi Ayam Geprek mengemban tugas untuk menemani akhir pekan anda.\r\n<br/><br/>\r\nSalah satu tugas yang harus dituntaskan oleh Nasi Ayam Geprek adalah, menjadi penyemangat anda untuk menulis daftar tujuan atau tempat rekreasi dan juga memberikan dorongan untuk kembali rutin berolahraga di akhir pekan nanti!', 'content', 'asset/c24d010ceea180d36d79c18255f21a902e6976b084d4d4989e3371c046e04cd51.png', '', '2022-01-19 11:32:02', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A12', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (58, 'ATC-327BE5305', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Gila', 'â€œSaat ada yang pasti-pasti kenapa harus pilih yang masih mengganjal di dalam hati?â€ Karena hal ini lah Nasi Goreng Gila pun dihadirkan oleh Pandan Garden.', 'HTML', 'â€œSaat ada yang pasti-pasti kenapa harus pilih yang masih mengganjal di dalam hati?â€ Karena hal ini lah Nasi Goreng Gila pun dihadirkan oleh Pandan Garden. Biasanya, agenda akhir pekan selalu berakhir hanya dengan rancangan, entah teman yang susah diajak nongkrong, jadwal yang bertabrakan, atau kondisi cuaca yang tak pernah menentu.\r\n<br/><br/>\r\nDi sinilah Nasi Goreng Gila berperan, dengan sajian yang lengkap dari nasi goreng hingga isian yang mantap, menu ini pun dipercaya akan menyelamatkan agenda akhir pekan anda agar menjadi lebih produktif dan penuh dengan kebahagiaan. Siap menggila kapan saja bersama Nasi Goreng Gila!', 'content', 'asset/36266edc5e23357a1ad144b110d50730837a9b2fafedc553f7d81697f134e4ff.png', '', '2022-01-19 11:33:35', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A12', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (59, 'ATC-535BE7212', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Serundeng', 'Parutan kelapa yang dimasak menggunakan metode yang dirahasiakan ini akan menarik nafsu makan yang hilang di akhir pekan.', 'HTML', 'Parutan kelapa yang dimasak menggunakan metode yang dirahasiakan ini akan menarik nafsu makan yang hilang di akhir pekan. Nasi Ayam Serundeng namanya, kelezatan dan gurihnya ayam goreng akan menjadi penentu rencana anda saat ingin melangkahkan kaki menuju akhir pekan.\r\n<br/><br/>\r\nAgenda seperti basket, futsal, ataupun badminton akan menjadi lebih bertenaga ketika masakan ini telah berhasil mengenyangkan perut para pembaca! Tanpa perlu ragu, nantikan PO-nya dibuka~.', 'content', 'asset/fd663b422cb15b48c53926f4b1618922245f244867508001f3736bb454b089dd.png', '', '2022-01-19 11:35:43', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A12', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (60, 'ATC-994BE8918', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Kare Ayam', 'Siapa yang tak kenal ayam yang berbumbu rempah kuning ini? Yup, ayam segar yang diolah dengan kunir ini pun tak kalah untuk unjuk gigi di akhir bulan Januari! Mari kita panggil Nasi Kare Ayam, sang penjaga gawang masakan lezat khas Nusantara di akhir bulan!', 'HTML', 'Siapa yang tak kenal ayam yang berbumbu rempah kuning ini? Yup, ayam segar yang diolah dengan kunir ini pun tak kalah untuk unjuk gigi di akhir bulan Januari! Mari kita panggil Nasi Kare Ayam, sang penjaga gawang masakan lezat khas Nusantara di akhir bulan!\r\n<br/><br/>\r\nBagi para pembaca yang sudah mengikuti jadwal Pre-Ordernya di minggu ini pastinya sudah paham kalau hari ini, adalah hari Nasi Kare Ayam bisa dengan lahap dimakan! Seperti halnya menu-menu yang lain, Nasi Kare Ayam ini diolah menggunakan rempah asli Indonesia. Bisa jadi bumbu Kare yang dilahap saat ini berasal dari berbagai penjuru negeri! Jadi serasa jalan-jalan hanya dengan satu kotak menu spesial PO Nasi Kare Ayam kan?', 'content', 'asset/172717c193c86ab9d62821f161974d72210c9529699951b54872827092a1be5b.png', '', '2022-01-19 11:39:27', '', '2022-01-01 00:00:00', '2022-01-31 23:59:00', 'A12', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (61, 'ATC-657BE6668', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bulan Februari, bulan yang hangat di hati', 'Halo? Masih semangat kan untuk menyambut awal bulan? Hehe.., pupuk semangat di bulan Februari kali ini dengan hidangan yang pas dengan kalender yang serba menyenangkan.', 'HTML', 'Halo? Masih semangat kan untuk menyambut awal bulan? Hehe.., pupuk semangat di bulan Februari kali ini bersama hidangan yang pas dengan kalender yang serba menyenangkan. Ada Seasonal Menu Masakan Medan yang sudah siap menyambut anda sekalian!', 'header', 'asset/3d5540fc954710d3a73e6592326b28009078313deac2a5d6b5bd27d27a0bd5b0.png', '', '2022-01-19 11:40:53', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A13', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (62, 'ATC-527BE2281', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bulan Februari, bulan yang hangat di hati (Footer)', 'Explore rasa Lontong Sayur dan Seasonal Menu lainnya hanya di Pandan Garden!', 'HTML', 'Explore rasa Lontong Sayur dan Seasonal Menu lainnya hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812012.jpg', '', '2022-01-19 11:42:51', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A13', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (63, 'ATC-309BE6294', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Lontong Sayur', 'Tahun baru Imlek jatuh pada 1 Februari 2022 kemarin, lalu apa yang membuatnya nampak kurang lengkap untuk anda para pembaca? Yup, bisa jadi karena hidangan ala-alanya masih belum tersedia untuk anda.', 'HTML', 'Tahun baru Imlek jatuh pada 1 Februari 2022 kemarin, lalu apa yang membuatnya nampak kurang lengkap untuk anda para pembaca? Yahhh, bisa jadi karena hidangan ala-alanya masih belum tersedia untuk anda. Melalui artikel ini, Pandan Garden mencoba memperkenalkan menu Khas Medan yang diberi nama Lontong Sayur. Menu yang dipenuhi rempah khas Nusantara ini akan lebih sempurna jika dihidangkan saat datangnya tahun baru Imlek.\r\n<br/><br/>\r\nBagi para perantau yang belum bisa merayakan Tahun Baru Imlek di kampung halaman, kali ini tak perlu bersedih. Walau Lontong Cap Go Meh belum bisa dirasakan kali ini, anda tetap bisa kok merasakan semua keseruannya dengan memesan Masakan Medan Lontong Sayur yang akan membuat siapa saja seperti berada di rumah.', 'content', 'asset/3d5540fc954710d3a73e6592326b28009078313deac2a5d6b5bd27d27a0bd5b01.png', '', '2022-01-19 11:45:51', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A13', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (64, 'ATC-544BE6894', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Sekelebat bayangan Hari Valentine dalam Nasi Tongseng Kambing', 'â€œKalau aku jadi bintang,, kamu jadi rembulannya ya?â€ Kalau ditanya si dia demikian, apa yang harus kalian jawab nih teman-teman!?. ', 'HTML', 'â€œKalau aku jadi bintang,, kamu jadi rembulannya ya?â€ Kalau ditanya si dia demikian, apa yang harus kalian jawab nih teman-teman!?. Ehm ehm, tenang saja masih ada cara mengungkapkan perasaan yang sesungguhnya tanpa harus menjawab pertanyaan yang susah ditebak kok!', 'header', 'asset/b21d143d98f998fddcd4a9933140ff7bd780edd32553011303ba97b49c13ec35.png', '', '2022-02-09 14:39:53', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A14', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (65, 'ATC-648BE8184', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Sekelebat bayangan Hari Valentine dalam Nasi Tongseng Kambing (Footer)', 'Nyatakan cinta dan pesan menunya segera hanya di Pandan Garden!', 'HTML', 'Nyatakan cinta dan pesan menunya segera hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812013.jpg', '', '2022-02-09 14:41:22', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A14', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (66, 'ATC-561BE8070', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Tongseng Kambing', 'Tak perlu ragu saat ingin menyatakan perasaan ke orang yang disukai, beberapa hari lagi adalah harinya kalian untuk mengungkapkannya secara terbuka! Walaupun begitu, terkadang memang masih ada yang mengganjal dalam hati ataupun mulut dan lidah yang tidak bisa diajak berkompromi.', 'HTML', 'Tak perlu ragu saat ingin menyatakan perasaan ke orang yang disukai, beberapa hari lagi adalah harinya kalian untuk mengungkapkannya secara terbuka! Walaupun begitu, terkadang memang masih ada yang mengganjal dalam hati ataupun mulut dan lidah yang tidak bisa diajak berkompromi. Sebagai partner makanan kalian, Pandan Garden dengan sukarela membagikan solusi untuk anda di Hari Valentine nanti!\r\n<br/><br/>\r\nDi sini telah terlampir gambar yang sedari tadi kalian pantau kan? Yes ini adalah Nasi Tongseng Kambing, salah satu menu soup di tempat kami yang memiliki rasa yang khas untuk membantu para pembaca Wacana mengisi tenaga, mengolah kata, dan memberikan kepercayaan diri untuk menyatakan hati di Hari Valentine nanti!', 'content', 'asset/b21d143d98f998fddcd4a9933140ff7bd780edd32553011303ba97b49c13ec351.png', '', '2022-02-09 14:43:37', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A14', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (67, 'ATC-856BE1103', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bahan-bahan memasak yang wajib tersedia di dapur!', 'Seperti yang diketahui para pembaca Wacana di manapun berada, ada beberapa bahan atau rempah yang sejatinya harus selalu tersedia di dapur.', 'HTML', 'Seperti yang diketahui para pembaca Wacana di manapun berada, ada beberapa bahan atau rempah yang sejatinya harus selalu tersedia di dapur. Baik untuk menumis, menggoreng, membuat sup, dan masih banyak lagi lainnya! Bahan atau rempah apa sajakah itu,, yuk mari kita tinjau!', 'header', 'asset/3580d933906cab9e8220725969993177a3a0e0f4dfd97f413204f52725ee8c87.png', '', '2022-02-16 15:31:52', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A15', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (68, 'ATC-301BE7153', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bahan-bahan memasak yang wajib tersedia di dapur! (Footer)', 'Kalau tidak suka memasak yaa apa boleh buat, pesan saja menu-menu terbaik yang selalu tersedia hanya di Pandan Garden!', 'HTML', 'Kalau tidak suka memasak yaa apa boleh buat, pesan saja menu-menu terbaik yang selalu tersedia hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812014.jpg', '', '2022-02-16 15:33:21', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A15', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (69, 'ATC-555BE6881', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bahan-Bahan Memasak', 'Selain gula dan garam, ada pula bahan atau rempah yang harus ada.', 'HTML', 'Selain gula dan garam, ada pula bahan atau rempah yang harus ada. Bahan-bahan tersebut tak lain dan tak bukan adalah Cabai merah/hijau, cabai rawit, tomat, bawang-bawangan, serta telur! Karena dari sekian bahan atau rempah yang sudah disebutkan, banyak masakan yang bisa dikreasikan. Salah satu yang paling mudah adalah nasi goreng dan omelette!\r\n<br/><br/>\r\nKarena setiap bahan memiliki fungsi tersendiri dalam proses memasak, bisa diibaratkan jika bahan atau rempah tersebut adalah kunci dari sebuah hidangan lezat. Memasak merupakan bagian terpenting dalam sebuah proses mencintai makanan. Melalui memasak, semua orang akan memahami tentang bagaimana sebuah rasa itu tercipta. Maka dari itu, bahan-bahan yang sudah kami sebutkan di atas hendaknya harus segera disediakan di dapur masing-masing ya!', 'content', 'asset/3580d933906cab9e8220725969993177a3a0e0f4dfd97f413204f52725ee8c871.png', '', '2022-02-16 15:40:26', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A15', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (70, 'ATC-521BE6897', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kumpulkan niat hilangkan rasa penat, menu spesial PO bulan Februari sukses menjadi makanan penyelamat!', 'Menuju hari-hari akhir di bulan Februari, masih semangat? Hehe.., ', 'HTML', 'Menuju hari-hari akhir di bulan Februari, masih semangat? Hehe.., tentunya setiap orang memiliki rasa yang berbeda-beda dalam menjalani bulan ini, tapi menu spesial PO kami masih sama dan siap menyelamatkan akhir pekan di akhir bulan para pembaca sekalian dengan penuh semangat! Yuk langsung saja menuju para jawaranya!', 'header', 'asset/7a7e3a2f3ce2604ba0011088c1631743a137b1b2c5e3775a5a01a21327cfd362.png', '', '2022-02-23 16:56:11', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A16', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (71, 'ATC-660BE2022', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kumpulkan niat hilangkan rasa penat, menu spesial PO bulan Februari sukses menjadi makanan penyelamat! (Footer)', 'Nantikan menu PO selanjutnya di awal bulan depan yang tentunya akan membuat anda semakin penasaran. ', 'HTML', 'Nantikan menu PO selanjutnya di awal bulan depan yang tentunya akan membuat anda semakin penasaran. Ikuti terus update menu spesial PO hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812015.jpg', '', '2022-02-23 16:57:46', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A16', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (72, 'ATC-107BE5630', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Goreng Kalasan', 'Citarasa gurih yang di campur rempah-rempah menjadikan Nasi Ayam Goreng Kalasan salah satu makanan pilihan bagi setiap orang.', 'HTML', 'Citarasa gurih yang di campur rempah-rempah menjadikan Nasi Ayam Goreng Kalasan salah satu makanan pilihan bagi setiap orang. Bahkan, hanya dengan sesuap saja bisa langsung terasa lezatnya. Hidangan ini pun dilengkapi dengan kremesan yang memiliki tekstur renyah saat dikonsumsi.\r\n<br/><br/>\r\nJangan bingung, ragu, ataupun khawatir! Nasi Ayam Goreng Kalasan menjadi pilihan yang tepat untuk melengkapi hari di akhir pekan anda. Ubah semua rasa penat menjadi semangat dengan menu spesial PO. Perpaduan antara porsi dan isian dari Nasi Ayam Goreng Kalasan sangat cocok menjadi penyemangat akhir pekan!', 'content', 'asset/7a7e3a2f3ce2604ba0011088c1631743a137b1b2c5e3775a5a01a21327cfd3621.png', '', '2022-02-23 17:00:55', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A16', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (73, 'ATC-896BE2006', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Dory Salted Egg', 'Halo~ panggil saya Dory.., saya adalah salah satu jenis diantara banyaknya spesiesnya ikan, hehehe. Jadi, sebagai tambahan informasi kalau Dory ini juga digunakan sebagai bahan dasar dari berbagai variasi makanan di Indonesia.', 'HTML', 'Halo~ panggil saya Dory.., saya adalah salah satu jenis diantara banyaknya spesiesnya ikan, hehehe. Jadi, sebagai tambahan informasi kalau Dory ini juga digunakan sebagai bahan dasar dari berbagai variasi makanan di Indonesia. Nah, kalau Salted Eggnya adalah bumbu yang berasal dari kuning telur asin yang dihaluskan dan dibuat menjadi saus kental yang super-duper lezat. Keduanya dipadukan dalam satu porsi makanan bernama Nasi Dory Salted Egg.\r\n<br/><br/>\r\nRasa gurih dari tekstur Dory goreng tepung yang renyah dengan sentuhan akhir kelembutannya harus menjadi pilihan anda untuk mengisi akhir pekan. Pesan saat menu POnya dibuka ya!', 'content', 'asset/3ca022bb2f3341ed31aa9903e7318081b970ad8a4ba3636c0e1ba99995781f5b.png', '', '2022-02-23 17:06:37', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A16', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (74, 'ATC-265BE1837', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Krengsengan Ayam', 'Krengsengan berbahan dasar daging ayam.. hmm sudah bukan hal baru di Pandan Garden! Nasi Krengsengan Ayam kami sejauh ini telah menjadi primadona tersendiri di dalam hati masyarakat! Terbukti dengan jumlah pemesan dalam 1 hari membuat slot pesanan menjadi penuh!', 'HTML', 'Krengsengan berbahan dasar daging ayam.. hmm sudah bukan hal baru di Pandan Garden! Nasi Krengsengan Ayam kami sejauh ini telah menjadi primadona tersendiri di dalam hati masyarakat! Terbukti dengan jumlah pemesan dalam 1 hari membuat slot pesanan menjadi penuh!\r\n<br/><br/>\r\nYah, itu semua karena para pembaca di artikel sebelumnya bisa jadi sangat-sangat menantikan dibukanya jadwal PO si Nasi Krengsengan Ayam ini. Memang rasa penasaran sama sekali tidak bisa terbendung kalau sudah berhadapan dengan masakan yang â€œbikin gak nahanâ€!', 'content', 'asset/dd07bc8aa1da4411d6b86166c3441c3aecdc15628f3b15d4e8fcb20d202fd032.png', '', '2022-02-23 17:08:00', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A16', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (75, 'ATC-521BE4974', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Bali', 'Hidangan yang dihasilkan dari perpaduan bumbu-bumbu khas kuliner Bali. Seperti daun salam, daun jeruk, lengkuas, kunyit, kemiri, terasi, dengan saus tiram dan kecap asin serta bumbu pelengkap lainnya menjadikan variasi dari nasi goreng ini patut dicoba.', 'HTML', 'Hidangan yang dihasilkan dari perpaduan bumbu-bumbu khas kuliner Bali. Seperti daun salam, daun jeruk, lengkuas, kunyit, kemiri, terasi, dengan saus tiram dan kecap asin serta bumbu pelengkap lainnya menjadikan variasi dari nasi goreng ini patut dicoba. Seperti halnya Menu spesial PO lainnya, Nasi Goreng Bali tersedia komplit bersama dengan isiannya!\r\n<br/><br/>\r\nTanpa perlu repot untuk ke Bali atau menyiapkan semua bumbunya, anda hanya perlu duduk dan memesan menu spesial PO ini sehingga Nasi Goreng Bali akan siap dihidangkan secara lengkap untuk anda nikmati sebagai pelengkap akhir pekan nanti.', 'content', 'asset/08cd355687586133e716247fa8460296303f7343b753d2b0236a2910e2706f91.png', '', '2022-02-23 17:08:56', '', '2022-02-01 00:00:00', '2022-02-28 23:59:00', 'A16', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (76, 'ATC-590BE1741', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi goreng, comfort food paling digemari muda-mudi masa kini!', 'Comfort food atau makanan yang seringkali dikonsumsi adalah sebutan untuk makanan dipilih oleh seseorang selama dirumah maupun bepergian.', 'HTML', 'Comfort food atau makanan yang seringkali dikonsumsi adalah sebutan untuk makanan dipilih oleh seseorang selama dirumah maupun bepergian. Nasi goreng, adalah salah satu makanan yang bisa dikatakan wajib dikonsumsi kapanpun. Dibuktikan dengan banyaknya gerai dan restoran yang menyuguhkan nasi goreng sebagai hidangan andalannya.', 'header', 'asset/6ca38d7917e0ae1730598c052bee650a05b0eeff07cd1e1f7e412319be180f45.png', '', '2022-03-02 16:00:59', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A17', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (77, 'ATC-356BE4571', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi goreng, comfort food paling digemari muda-mudi masa kini! (Footer)', 'Temukan comfort food anda beserta menu pendamping lainnya hari ini hanya di Pandan Garden!', 'HTML', 'Temukan comfort food anda beserta menu pendamping lainnya hari ini hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812016.jpg', '', '2022-03-02 16:02:03', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A17', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (78, 'ATC-909BE2368', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Teri', 'Seperti halnya kuliner unik lainnya, nasi goreng tentu memiliki banyak variasi dan kombinasi dari berbagai macam bahan. ', 'HTML', 'Seperti halnya kuliner unik lainnya, nasi goreng tentu memiliki banyak variasi dan kombinasi dari berbagai macam bahan. Nasi Goreng Teri salah satunya, salah satu kuliner khas Medan yang dipercaya membuat siapa saja jatuh cinta. Senada dengan namanya, Nasi Goreng Teri dimasak layaknya nasi goreng pada umumnya namun dengan menggunakan bumbu, isian, dan tentunya ikan teri sebagai bahan andalannya!\r\n<br/><br/>\r\nPandan Garden berusaha menangkap semua keinginan masyarakat akan hadirnya kuliner yang memiliki rasa otentik langsung dari setiap daerah di Indonesia. Melalui kategori Seasonal Menu Masakan Medan, Nasi Goreng Teri akan membuat para pembaca sekalian menambahkannya pada daftar comfort food segera setelah mencium aromanya. Kalau bingung hari ini mau makan apa, bolehlah cicip dulu Nasi Goreng Terinya~.', 'content', 'asset/6ca38d7917e0ae1730598c052bee650a05b0eeff07cd1e1f7e412319be180f451.png', '', '2022-03-02 16:03:10', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A17', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (79, 'ATC-657BE8889', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kuliner berkuah dari pulau Sumatra, Soto Ayam Medan!', 'Indonesia memiliki beragam kuliner yang tersebar di masing-masing wilayahnya. Tiap makanan memiliki ciri khas daerahnya sendiri, tak terkecuali kuliner Medan, Sumatra Utara.\r\nSoto Ayam Medan, dan semua harus tau tentang masakan ini! ', 'HTML', 'Indonesia memiliki beragam kuliner yang tersebar di masing-masing wilayahnya. Tiap makanan memiliki ciri khas daerahnya sendiri, tak terkecuali kuliner Medan, Sumatra Utara.\r\nSoto Ayam Medan, dan semua harus tau tentang masakan ini!', 'header', 'asset/5ca8f3b688858ad42cfca86c19587a20c74234b633505d4cac2d34e849a27967.png', '', '2022-03-10 17:10:04', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A18', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (80, 'ATC-654BE7921', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kuliner berkuah dari pulau Sumatra, Soto Ayam Medan! (Footer)', 'Apapun olahan sotonya, Soto Ayam Medan satu ini perlu untuk di pertimbangkan! Pesan sekarang di Pandan Garden.', 'HTML', 'Apapun olahan sotonya, Soto Ayam Medan satu ini perlu untuk di pertimbangkan! Pesan sekarang di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812017.jpg', '', '2022-03-10 17:11:07', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A18', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (81, 'ATC-599BE2278', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Soto Ayam Medan', 'Soto Ayam Medan merupakan salah satu kuliner Indonesia yang memiliki berbagai varian berbeda di tiap daerah. Namun, pada dasarnya Soto Ayam Medan adalah makanan yang berkuah kuning dari kunyit dengan suwiran ayam di dalamnya. Begitu pula Medan, menjadikan soto ayam memiliki citarasa tersendiri yang menjadikan makanan ini menjadi ciri khas kota besar ini.', 'HTML', 'Soto Ayam Medan merupakan salah satu kuliner Indonesia yang memiliki berbagai varian berbeda di tiap daerah. Namun, pada dasarnya Soto Ayam Medan adalah makanan yang berkuah kuning dari kunyit dengan suwiran ayam di dalamnya. Begitu pula Medan, menjadikan soto ayam memiliki citarasa tersendiri yang menjadikan makanan ini menjadi ciri khas kota besar ini.\r\n<br/><br/>\r\nSemangkuk nasi dengan isian lengkap ditambah telur ayam serta disiram kuah yang lezat menjadikan makanan ini pilihan yang tepat untuk mengawali akhir pekan anda. Tanpa perlu bingung mencari resep atau bahkan pergi ke Medan, Pandan Garden siap memenuhi hasrat rasa penasaran anda dengan makanan khas yang satu ini. Memiliki rasa yang tentunya sedap dimulut dan kenyang diperut. Pesan sekarang dan bayangkan kota Medan dalam semangkuk Soto Ayam Medan!.', 'content', 'asset/5ca8f3b688858ad42cfca86c19587a20c74234b633505d4cac2d34e849a279671.png', '', '2022-03-10 17:12:15', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A18', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (82, 'ATC-197BE9236', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Semua tentang Mie Ayam Medan!', 'Khazanah kuliner anda semakin bertambah dengan rangkaian Seasonal Menu Masakan Medan yang diracik demi rasa otentik yang nikmat.', 'HTML', 'Khazanah kuliner anda semakin bertambah dengan rangkaian Seasonal Menu Masakan Medan yang diracik demi rasa otentik yang nikmat. Medan yang kaya dengan budaya kuliner, menjadi inspirasi menu premium yang bisa dinikmati oleh semua kalangan. Kali ini, kita membahas Mie Ayam Medan yang melegenda!', 'header', 'asset/f5b3a9b2ca4487e4028eb37c4b36c496e196db30d2a5276ea22dc516dd3f2b23.png', 'asset/f5b3a9b2ca4487e4028eb37c4b36c496e196db30d2a5276ea22dc516dd3f2b232.png', '2022-03-11 15:17:31', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A19', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (83, 'ATC-254BE6620', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Semua tentang Mie Ayam Medan! (Footer)', 'Mie Ayam Medan spesial kini bisa dipesan dengan mudah hanya di Pandan Garden. ', 'HTML', 'Mie Ayam Medan spesial kini bisa dipesan dengan mudah hanya di Pandan Garden. ', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812018.jpg', '', '2022-03-11 15:18:29', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A19', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (84, 'ATC-998BE4388', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Mie Ayam Medan', 'Tidak ada catatan pasti kapan dan dari mana asal-muasal Mie Ayam Medan. Yang jelas, rasanya yang khas dan bahan-bahannya yang sederhana memunculkan berbagai kombinasi bahan yang semuanya disukai masyarakat. Nah, umumnya Mie Ayam Medan terdiri dari bahan inti mie basah kenyal, daging ayam, dan kuah bumbu yang khas. Beberapa tambahan lain dapat dikreasikan sendiri dan dikombinasikan sesuai selera penikmatnya.', 'HTML', 'Tidak ada catatan pasti kapan dan dari mana asal-muasal Mie Ayam Medan. Yang jelas, rasanya yang khas dan bahan-bahannya yang sederhana memunculkan berbagai kombinasi bahan yang semuanya disukai masyarakat. Nah, umumnya Mie Ayam Medan terdiri dari bahan inti mie basah kenyal, daging ayam, dan kuah bumbu yang khas. Beberapa tambahan lain dapat dikreasikan sendiri dan dikombinasikan sesuai selera penikmatnya.\r\n<br/><br/>\r\nAgar lebih mengenyangkan dan memperkaya rasanya, ditambahkan pelengkap berupa telur rebus matang atau bacem, tauge, sayuran, acar wortel dan timun, serta bawang goreng. Sebagai perasa tambahan tentu saja ada sambal, saus tomat dan kecap. Cara orang menikmati Mie Ayam Medan tentu saja berbeda-beda, tapi kenikmatannya tetaplah sama. Apalagi bagi penikmat setia sajian mie, pastikan Mie Ayam Medan sudah masuk dalam daftar favorit para pembaca Wacana~.', 'content', 'asset/f5b3a9b2ca4487e4028eb37c4b36c496e196db30d2a5276ea22dc516dd3f2b231.png', 'asset/f5b3a9b2ca4487e4028eb37c4b36c496e196db30d2a5276ea22dc516dd3f2b233.png', '2022-03-11 15:53:04', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A19', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (85, 'ATC-686BE9024', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Menyambut bulan Ramadhan bersama Menu Spesial PO yang jadi andalan!', 'Seminggu lagi menuju bulan Puasa, akan tetapi yang ingin kami tanyakanâ€¦apakah para pembaca semua sudah punya rencana akan berbuka puasa dengan makanan apa? Kami yakin belum, hehe.', 'HTML', 'Seminggu lagi menuju bulan Puasa, akan tetapi yang ingin kami tanyakanâ€¦apakah para pembaca semua sudah punya rencana akan berbuka puasa dengan makanan apa? Kami yakin belum, hehe. Walaupun masih seminggu lagi, Pandan Garden menyarankan semuanya agar punya daftar menu pilihannya! Mari bersama-sama mengintip semua menu spesial PO bulan Maret yang telah berhasil mengenyangkan semua orang!', 'header', 'asset/cbb374226649fcb80396a980a6346de026c949fb80c18032565f4a88dbc76593.png', '', '2022-03-11 15:54:29', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A20', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (86, 'ATC-184BE2755', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Menyambut bulan Ramadhan bersama Menu Spesial PO yang jadi andalan! (Footer)', 'Tanyakan kepada kami tentang menu apa saja yang akan hadir di bulan Puasa nanti ya! Atau ikuti saja update jadwal Pre-Ordernya setiap Senin sampai Rabu hanya di Pandan Garden.', 'HTML', 'Tanyakan kepada kami tentang menu apa saja yang akan hadir di bulan Puasa nanti ya! Atau ikuti saja update jadwal Pre-Ordernya setiap Senin sampai Rabu hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812019.jpg', '', '2022-03-11 15:57:00', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A20', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (87, 'ATC-265BE5602', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Geprek', 'Sensasi pedas yang sanggup membuat anda bersemangat selalu punya cara tersendiri untuk menggugah selera. Yup, yang pedas-pedas itu adalah the one and only Nasi Ayam Geprek! Siapa yang belum kenal hayo? Pandan Garden pernah mengulas menu PO ini di artikel-artikel sebelumnya. Sambal bawangnya yang punya ciri merah menggiurkan, ayam goreng tepung, dan isian lainnya yang tak kalah lezat dan mengenyangkan.', 'HTML', 'Sensasi pedas yang sanggup membuat anda bersemangat selalu punya cara tersendiri untuk menggugah selera. Yup, yang pedas-pedas itu adalah the one and only Nasi Ayam Geprek! Siapa yang belum kenal hayo? Pandan Garden pernah mengulas menu PO ini di artikel-artikel sebelumnya. Sambal bawangnya yang punya ciri merah menggiurkan, ayam goreng tepung, dan isian lainnya yang tak kalah lezat dan mengenyangkan.\r\n<br/><br/>\r\nTak perlu khawatir, rasa pedas dan bumbunya masih bisa anda rasakan secara seimbang. Sehingga satu suap dari kombinasi semuanya akan memberikan sensasi sesungguhnya dari Nasi Ayam Geprek yang sedang ramai diperbincangkan!', 'content', 'asset/cbb374226649fcb80396a980a6346de026c949fb80c18032565f4a88dbc765931.png', '', '2022-03-11 15:58:16', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A20', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (88, 'ATC-673BE2385', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Gila', 'Kalau di artikel sebelumnya kita punya Seasonal Menu Masakan Medan Nasi Goreng Teri, di menu spesial PO pun juga ada kreasi nasi goreng yang tak kalah menarik! Mari kita sambut, Nasi Goreng Gila! Kuliner dari bagian barat pulau Jawa, Ibukota Indonesia. Mengapa menu ini punya nama demikian? Ada yang tau?', 'HTML', 'Kalau di artikel sebelumnya kita punya Seasonal Menu Masakan Medan Nasi Goreng Teri, di menu spesial PO pun juga ada kreasi nasi goreng yang tak kalah menarik! Mari kita sambut, Nasi Goreng Gila! Kuliner dari bagian barat pulau Jawa, Ibukota Indonesia. Mengapa menu ini punya nama demikian? Ada yang tau?\r\n<br/><br/>\r\nWell, menurut Pandan Garden, Nasi Goreng Gila merupakan sebuah nama yang dihasilkan dari tampilan asli dari kreasi nasi goreng yang mengalami proses pencampuran berbagai bahan dan item lengkap saat proses penggorengan, hehehe. Dilihat dari namanya, menu ini cukup menggila untuk anda yang senang berburu kuliner Nusantara.', 'content', 'asset/b3d2f7eabbfd26a176d85fc574e12cb26b2724eaba07491697e49bd03f740599.png', '', '2022-03-11 15:59:11', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A20', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (89, 'ATC-775BE7037', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Serundeng', 'Banyak followers Instagram @pandan.garden yang menanyakan apakah Pandan Garden memiliki menu olahan ayam yang punya sambal disertai serundeng seperti masakan di Jawa Barat. Jawabannya adalahâ€¦Jelas ada lah! Nasi Ayam Serundeng namanya. Menu ini adalah salah satu dari beberapa menu PO yang punya antusias besar dari khalayak!', 'HTML', 'Banyak followers Instagram @pandan.garden yang menanyakan apakah Pandan Garden memiliki menu olahan ayam yang punya sambal disertai serundeng seperti masakan di Jawa Barat. Jawabannya adalahâ€¦Jelas ada lah! Nasi Ayam Serundeng namanya. Menu ini adalah salah satu dari beberapa menu PO yang punya antusias besar dari khalayak!\r\n<br/><br/>\r\nIni membuktikan kalau Pandan Garden selalu punya solusi memenuhi kebutuhan masyarakat akan makanan yang pas untuk mengarungi akhir pekan! Setiap helai serundeng membawa pesan â€œenak kan? lezat kan? mau lagi?â€ pada setiap gigitan ayam dan sesuap nasi.', 'content', 'asset/b5fb52fafca599e9e44238c0882bc00698f6b4c79bec7cc64a85abdbfab76876.png', '', '2022-03-11 16:03:44', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A20', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (90, 'ATC-943BE5885', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Kare Ayam', 'Bumbu rempah kuning pekat yang menyelimuti seluruh sisi dari ayam ini bukan lagi hal baru untuk para pembaca. Yes betul, ini adalah Nasi Kare Ayam. Bisa jadi Nasi Kare Ayam pada menu spesial PO kali ini adalah hal baru bagi semuanya karena kare yang ini adalah versi compact dari kare-kare yang biasanya, hehe.', 'HTML', 'Bumbu rempah kuning pekat yang menyelimuti seluruh sisi dari ayam ini bukan lagi hal baru untuk para pembaca. Yes betul, ini adalah Nasi Kare Ayam. Bisa jadi Nasi Kare Ayam pada menu spesial PO kali ini adalah hal baru bagi semuanya karena kare yang ini adalah versi <i>compact</i> dari kare-kare yang biasanya, hehe.\r\n<br/><br/>\r\nYup, tanpa perlu basa-basi lagi, menu ini sudah berhasil memberikan performa terbaiknya pada para pemesan beruntung yang telah menikmatinya sembari artikel ini terbit pada seminggu sebelum bulan Ramadhan datang~', 'content', 'asset/7495fdbe52e754d2c7d2e6126ca07fee428ea163c440604e98478c7a6304e889.png', '', '2022-03-11 16:05:00', '', '2022-03-01 00:00:00', '2022-03-31 23:59:00', 'A20', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (91, 'ATC-498BE6703', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kisah Kuliner: ternyata ini sejarah Sambal Terasi yang legendary', 'Dalam buku Southeast Asian Food: Classic and Modern Dishes karya Rosemary Brissenden (2007) dijelaskan, tradisi sambal Indonesia sudah ada lho sejak pemerintahan Sultan Cirebon I, yakni Pangeran Walasungsang atau Pangeran Cakrabuana.', 'HTML', 'Tahukah Anda kalau sambal terasi sudah ada sejak abad ke-15?\r\nHari Jumat, Pandan Garden kembali lagi dengan info seputar kuliner seantero Indonesia! Kali ini kita belajar sejarah Sambal Terasi, satu dari puluhan jenis sambal yang legendary. Ada yang tahu, Sambal Terasi yang khas rasa udang dan sedikit asam itu ada sejak kapan, sih?', 'header', 'asset/9955d7615be3aa5791f84be96f576cc214460a891669c73238fe4e2cc0500525.png', 'asset/9955d7615be3aa5791f84be96f576cc214460a891669c73238fe4e2cc05005251.png', '2022-03-11 16:10:49', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A21', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (92, 'ATC-174BE7448', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Kisah Kuliner: ternyata ini sejarah sambal terasi yang legendary (Footer)', 'Lengkapi pilihan nikmat Sambal Terasi dengan berbagai sajian lainnya, langsung dari dapur Pandan Garden!', 'HTML', 'Lengkapi pilihan nikmat Sambal Terasi dengan berbagai sajian lainnya, langsung dari dapur Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812020.jpg', '', '2022-03-11 16:14:15', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A21', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (93, 'ATC-632BE9023', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Sambal Terasi', 'Dalam buku Southeast Asian Food: Classic and Modern Dishes karya Rosemary Brissenden (2007) dijelaskan, tradisi sambal Indonesia sudah ada lho sejak pemerintahan Sultan Cirebon I, yakni Pangeran Walasungsang atau Pangeran Cakrabuana.', 'HTML', 'Dalam buku Southeast Asian Food: Classic and Modern Dishes karya Rosemary Brissenden (2007) dijelaskan, tradisi sambal Indonesia sudah ada lho sejak pemerintahan Sultan Cirebon I, yakni Pangeran Walasungsang atau Pangeran Cakrabuana. Dikutip dari kompas.com, konon sang pangeran gemar menangkap udang atau rebon yang kemudian diolahnya menjadi terasi. Bahan udang dan proses fermentasi menciptakan rasa gurih dan asamnya yang khas. Karena ternyata digemari banyak orang, terasi pun sampai ke telinga pemimpin armada dagang China, laksamana Cheng Ho (Zheng He) yang pada 1415 sering membawa pulang terasi ke negeri asalnya.\r\n<br/><br/>\r\nDalam Serat Centhini yang ditulis pada 1814, dirangkum pula 46 jenis sambal yang jadi bagian penting dari kebudayaan Nusantara saat itu, di antaranya sambal kluwak, gocek, trancam, dan juga Sambal Terasi. Nah, kalau Anda sudah ngidam Sambal Terasi dan kepingin langsung menyantapnya dengan nasi hangat, langsung deh cek menu â€œSambalâ€ di Pandan Garden dan pesan sambal favorit, sekalian hidangan utamanya biar bisa diantar langsung ke alamat Anda, tanpa ribet.', 'content', 'asset/9955d7615be3aa5791f84be96f576cc214460a891669c73238fe4e2cc05005252.png', 'asset/9955d7615be3aa5791f84be96f576cc214460a891669c73238fe4e2cc05005253.png', '2022-03-11 16:15:30', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A21', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (94, 'ATC-796BE5462', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bukan negara, Laos yang ini punya selera!', 'Jangan salah kira.. seperti judulnya, Laos yang ini tak lain dan tak bukan adalah Nasi Ayam Goreng Laos teman-teman! Menu ini adalah menu yang akan membuat anda menyelaraskan pikiran antara rutinitas akhir pekan, tiduran atau jadwal makan!', 'HTML', 'Jangan salah kira.. seperti judulnya, Laos yang ini tak lain dan tak bukan adalah Nasi Ayam Goreng Laos teman-teman! Menu ini adalah menu yang akan membuat anda menyelaraskan pikiran antara rutinitas akhir pekan, tiduran atau jadwal makan!', 'header', 'asset/98e18f46684be4fe542c9354f709cc57de51644f0a68e080f6d78c92965edd172.png', 'asset/98e18f46684be4fe542c9354f709cc57de51644f0a68e080f6d78c92965edd173.png', '2022-03-11 16:35:09', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A22', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (95, 'ATC-230BE4713', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bukan negara, Laos yang ini punya selera! (Footer)', 'Lengkapi kebutuhan kuliner anda dengan pilihan yang tepat hanya di Pandan Garden!', 'HTML', 'Lengkapi kebutuhan kuliner anda dengan pilihan yang tepat hanya di Pandan Garden!', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812021.jpg', '', '2022-03-11 16:36:59', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A22', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (96, 'ATC-192BE1240', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Goreng Laos', 'Nasi Ayam Goreng Laos menjadi pilihan yang cukup populer karena nama yang dibawanya. Sebab, menu ini disinyalir berasal dari negara tetangga Indonesia, Laos. Eits, tapi anda salah jika berpikir demikian, karena sesungguhnya menu ini adalah hidangan asli Indonesia! Bukan karena kami melebih-lebihkan, tetapi memang demikian.', 'HTML', 'Nasi Ayam Goreng Laos menjadi pilihan yang cukup populer karena nama yang dibawanya. Sebab, menu ini disinyalir berasal dari negara tetangga Indonesia, Laos. Eits, tapi anda salah jika berpikir demikian, karena sesungguhnya menu ini adalah hidangan asli Indonesia! Bukan karena kami melebih-lebihkan, tetapi memang demikian.\r\n<br/><br/>\r\nJangan bingung mau makan apa! Nasi Ayam Goreng Laos dari Pandan Garden bisa menjadi makanan pilihan yang baik untuk mengisi akhir pekan anda. Tanpa perlu bingung untuk memasak, tinggal duduk, pesan, lalu tunggu, makanan anda datang!', 'content', 'asset/98e18f46684be4fe542c9354f709cc57de51644f0a68e080f6d78c92965edd17.png', 'asset/98e18f46684be4fe542c9354f709cc57de51644f0a68e080f6d78c92965edd171.png', '2022-03-11 16:38:07', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A22', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (97, 'ATC-964BE4587', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rahasia kesegaran Sayur Asem!', 'Sayur asem di Indonesia sendiri memiliki beberapa versi masakan lokal di daerah masing-masing. Selain itu sayur asem juga memiliki khasiat yang baik untuk kesehatan loh! Seperti melindungi tubuh dari bahaya penyakit kronis dan mengontrol kadar gula darah.', 'HTML', 'Sayur asem di Indonesia sendiri memiliki beberapa versi masakan lokal di daerah masing-masing. Selain itu sayur asem juga memiliki khasiat yang baik untuk kesehatan loh! Seperti melindungi tubuh dari bahaya penyakit kronis dan mengontrol kadar gula darah.', 'header', 'asset/fb5e258882d860ebbf47d85ab1d58f40a28a3a56d55a29013896cc5a06518fac.png', 'asset/fb5e258882d860ebbf47d85ab1d58f40a28a3a56d55a29013896cc5a06518fac1.png', '2022-03-11 16:44:31', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A23', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (98, 'ATC-442BE2208', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Rahasia kesegaran Sayur Asem! (Footer)', 'Pesan sekarang dan rasakan kesegaran sayur asem khas Pandan Garden!.', 'HTML', 'Pesan sekarang dan rasakan kesegaran sayur asem khas Pandan Garden!.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812022.jpg', '', '2022-03-11 16:47:39', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A23', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (99, 'ATC-942BE7655', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Sayur Asem', 'Tidak bisa dipungkiri, citarasa asem dan asin ini menjadikan makanan ini terasa sekali khas Indonesianya. Karena saking Indonesianya, sayur asem mudah di temui di berbagai daerah sesuai dengan khas daerahnya masing-masing!', 'HTML', 'Tidak bisa dipungkiri, citarasa asem dan asin ini menjadikan makanan ini terasa sekali khas Indonesianya. Karena saking Indonesianya, sayur asem mudah di temui di berbagai daerah sesuai dengan khas daerahnya masing-masing! Cara menikmati sayur asam juga bermacam-macam. Seperti di Jawa Barat dan Betawi, orang menikmati sayur asam di mangkuk, terpisah dengan nasi. Tapi di Jawa Timur, lebih suka mencampur sayur asem, nasi dan lauk-pauk.\r\n<br/><br/>\r\nJangan hanya tersipu dengan tampilan dari sayur asem yang menawan, dibalik itu semua terdapat rasa segar, asin, dan asem dari asem jawa yang khas dicampur dengan bumbu pelengkap lainnya. Begitu pula Pandan Garden menyediakan menu masakan sayur asem dengan rasa yang tentunya nikmat dan patut dicoba.', 'content', 'asset/fb5e258882d860ebbf47d85ab1d58f40a28a3a56d55a29013896cc5a06518fac2.png', 'asset/fb5e258882d860ebbf47d85ab1d58f40a28a3a56d55a29013896cc5a06518fac3.png', '2022-03-11 16:49:25', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A23', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (100, 'ATC-512BE3015', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Selangkah lagi menuju Lebaran, menu spesial PO bulan April menyapa dalam kedamaian!', 'Kurang beberapa hari lagi sebelum bulan puasa berakhir, ini berarti menu PO bulan ini harus segera menceritakan pengalaman mereka selama sebulan penuh menjadi pemberi rasa kenyang andalan semua pelanggan~', 'HTML', 'Kurang beberapa hari lagi sebelum bulan puasa berakhir, ini berarti menu PO bulan ini harus segera menceritakan pengalaman mereka selama sebulan penuh menjadi pemberi rasa kenyang andalan semua pelanggan~', 'header', 'asset/680275f1f4a2d53fc50fcd567fb0f7b99f5b5d4769d836a9e3d6a0de51033ffe.png', '', '2022-03-11 16:50:42', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A24', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (101, 'ATC-250BE1894', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Selangkah lagi menuju Lebaran, menu spesial PO bulan April menyapa dalam kedamaian! (Footer)', 'Masih ada sisa hari lagi menuju Lebaran, nikmati menu spesial PO andalan anda untuk berbuka puasa hanya di Pandan Garden.', 'HTML', 'Masih ada sisa hari lagi menuju Lebaran, nikmati menu spesial PO andalan anda untuk berbuka puasa hanya di Pandan Garden.', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812023.jpg', '', '2022-03-11 16:52:03', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A24', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (102, 'ATC-647BE7380', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Goreng Kalasan', 'Tekstur bergelombang dari lapisan atas Nasi Ayam Goreng Kalasan adalah ciri unik makanan yang menempati level tertinggi dari kasta â€œkuliner lezatâ€. Berasal dari Sleman, Nasi Ayam Goreng Kalasan adalah bukti nyata warisan kuliner Nusantara. Menu ini jarang-jarang bisa anda temukan di Surabaya dan sekitarnya. Maka dari ituâ€¦sudah paham kanâ€¦ hehehe', 'HTML', 'Tekstur bergelombang dari lapisan atas Nasi Ayam Goreng Kalasan adalah ciri unik makanan yang menempati level tertinggi dari kasta â€œkuliner lezatâ€. Berasal dari Sleman, Nasi Ayam Goreng Kalasan adalah bukti nyata warisan kuliner Nusantara. Menu ini jarang-jarang bisa anda temukan di Surabaya dan sekitarnya. Maka dari ituâ€¦sudah paham kanâ€¦ hehehe\r\n<br/><br/>\r\nHanya menu spesial PO di Pandan Garden yang memiliki Nasi Ayam Goreng Kalasan! Meneruskan citarasa asli dari Sleman, menu ini menjadi kuliner pembuka awal bulan Puasa. Para pembaca sekalian kebagian menu ini belum?', 'content', 'asset/680275f1f4a2d53fc50fcd567fb0f7b99f5b5d4769d836a9e3d6a0de51033ffe1.png', '', '2022-03-11 16:53:34', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A24', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (103, 'ATC-581BE5878', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Dory Salted Egg', 'Menu fenonemal yang kerap jadi bahan perbincangan warganet di Twitter, TikTok, dan Instagram. Nasi Dory Salted Egg telah menjadi salah satu harapan baru bagi kaum-kaum lapar yang mudah bosan dengan menu yang itu-itu saja saat puasa. Menurut pengakuan Nasi Dory Salted Egg,, â€œselain karena menu ikan tengah diminati, saus salted egg kami juga punya peran melezatkan masakan iniâ€ pungkasnya. :D', 'HTML', 'Menu fenonemal yang kerap jadi bahan perbincangan warganet di Twitter, TikTok, dan Instagram. Nasi Dory Salted Egg telah menjadi salah satu harapan baru bagi kaum-kaum lapar yang mudah bosan dengan menu yang itu-itu saja saat puasa. Menurut pengakuan Nasi Dory Salted Egg,, â€œselain karena menu ikan tengah diminati, saus salted egg kami juga punya peran melezatkan masakan iniâ€ pungkasnya. :D\r\n<br/><br/>\r\nYahh, terlepas dari pengakuan menu spesial PO yang ini, memang setelah diamati, Nasi Dory Salted Egg ini cukup menggiurkan juga,, penulis jadi iri karena tidak kebagian jatah Pre-Ordernya akibat kehabisan. :â€™)', 'content', 'asset/024268518a2986f4647a6c20ee24f9b122eefd4b215e4a3bf459636a6108cc8f.png', '', '2022-03-11 16:54:29', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A24', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (104, 'ATC-993BE6266', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Krengsengan Ayam', 'Tak disangka-sangka ada menu krengsengan dari ayam!? Sorry guys, bukan hal baru lagi bagi Pandan Garden. Menu-menu di sini semuanya punya keunikan dan citarasa otentik dengan kreasi yang menakjubkan. Salah satunya ya ini, Nasi Krengsengan Ayam. Menu yang pada saat hari pertama Pre-Order saja sudah habis ditelan pemburu kenyang.', 'HTML', 'Tak disangka-sangka ada menu krengsengan dari ayam!? Sorry guys, bukan hal baru lagi bagi Pandan Garden. Menu-menu di sini semuanya punya keunikan dan citarasa otentik dengan kreasi yang menakjubkan. Salah satunya ya ini, Nasi Krengsengan Ayam. Menu yang pada saat hari pertama Pre-Order saja sudah habis ditelan pemburu kenyang.\r\n<br/><br/>\r\nSekarang, di antara para pembaca sekalian pasti jadi salah satu diantara pemburu kenyangnya kan? Hayo ngaku? Tapi, tak apalah karena semuanya rela menunggu jadwal Nasi Krengsengan Ayamnya tersedia di lain waktu~.', 'content', 'asset/89a426dbb93b473cd924b4e3328cf814d1514cbb1a4152e4aa3c9a86400646c4.png', '', '2022-03-11 16:55:23', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A24', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (105, 'ATC-637BE4858', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Bali', 'Saat bulan puasa, Nasi Goreng Bali memberikan cerita kepada para pelanggan tentang serunya ombak di pantai Kuta, dinginnya udara di Bedugul, atau harumnya aroma bunga pulau Dewata. Nasi Goreng Bali ingin memberikan performa maksimalnya kepada siapa saja yang berhasil memesan menunya!', 'HTML', 'Saat bulan puasa, Nasi Goreng Bali memberikan cerita kepada para pelanggan tentang serunya ombak di pantai Kuta, dinginnya udara di Bedugul, atau harumnya aroma bunga pulau Dewata. Nasi Goreng Bali ingin memberikan performa maksimalnya kepada siapa saja yang berhasil memesan menunya!\r\n<br/><br/>\r\n<i>by the way</i>, ada yang penasaran sama rasanya? Hmm.. bayangkan saja anda memakan masakan khas Bali disertai sambal matah yang diselesaikan dengan irisan ayam berbumbu rempah yang meledak di lidah! Sudah sudah,, nantikan menunya tersedia lagi ya~', 'content', 'asset/cb42d2ffc3c94fb88a7b74cdf8f250b56df6e43ed7dafa8b896c2fad3590850e.png', '', '2022-03-11 16:56:23', '', '2022-04-01 00:00:00', '2022-04-30 23:59:00', 'A24', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (106, 'ATC-493BE7906', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Yang campur-campur penyambut Lebaran!', 'Jumat kali ini masih seputar dengan nasi. Setelah sebelumnya Nasi Merah Komplit dan Nasi Jagung Komplit, kali ini kita ulas mengenai Nasi Campur Komplit! Menu yang akan menjadi pilihan anda saat Lebaran nanti!', 'HTML', 'Jumat kali ini masih seputar dengan nasi. Setelah sebelumnya Nasi Merah Komplit dan Nasi Jagung Komplit, kali ini kita ulas mengenai Nasi Campur Komplit! Menu yang akan menjadi pilihan anda saat Lebaran nanti!', 'header', 'asset/c34ae7aeb09c0b63d857abfd024a0f5d242cbebe3dd8db3fca83d2e9482f7dc1.png', '', '2022-03-11 16:57:28', '', '2022-05-01 00:00:00', '2022-05-31 23:59:00', 'A25', 'Draft', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (107, 'ATC-125BE4810', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Yang campur-campur penyambut Lebaran! (Footer)', 'Lebaran datang, Nasi Campur Komplit-lah yang jadi pilihan! Pesan sekarang hanya di Pandan Garden. ', 'HTML', 'Lebaran datang, Nasi Campur Komplit-lah yang jadi pilihan! Pesan sekarang hanya di Pandan Garden. ', 'footer', 'asset/dbaa0edcd02c250afa428e325b7e68884028f2a312742776757c2f044dea812024.jpg', '', '2022-03-11 16:58:39', '', '2022-05-01 00:00:00', '2022-05-31 23:59:00', 'A25', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (108, 'ATC-311BE5276', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Campur Komplit', 'Nasi campur adalah salah satu masakan khas Indonesia. Makanan ini terdiri atas nasi putih yang dihidangkan dengan bermacam-macam lauk-pauk. Isiannya bisa bermacam, ada yang mengombinasikan ayam, telur, mie sampai yang serba komplit seperti Nasi Campur Komplit! ', 'HTML', 'Nasi campur adalah salah satu masakan khas Indonesia. Makanan ini terdiri atas nasi putih yang dihidangkan dengan bermacam-macam lauk-pauk. Isiannya bisa bermacam, ada yang mengombinasikan ayam, telur, mie sampai yang serba komplit seperti Nasi Campur Komplit! \r\n<br/><br/>\r\nSetiap warung atau rumah makan memiliki variasi tersendiri dalam penyajian nasi campur. Apalagi saat Lebaran datang, terkadang para pembaca tak mengetahui makanan apa yang jadi pilihan untuk menyambut cerianya suasana Lebaran! Cukup pesan Nasi Campur Komplit di Pandan Garden yang pastinya akan membuat hari-hari anda lebih mengenyangkan!', 'content', 'asset/c34ae7aeb09c0b63d857abfd024a0f5d242cbebe3dd8db3fca83d2e9482f7dc11.png', '', '2022-03-11 16:59:48', '', '2022-05-01 00:00:00', '2022-05-31 23:59:00', 'A25', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (109, 'ATC-659BE8358', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Gurihnya Nasi Kare Ayam, bikin ketagihan!', 'Nasi Kare Ayam memiliki tekstur ayam yang empuk, kuahnya yang gurih ber-rempah ditambah hidangan pelengkapnya yang beraneka ragam membuat Nasi Kare Ayam jadi favorit banyak keluarga.', 'HTML', 'Ada beberapa hidangan khas di waktu lebaran. Ada ketupat, minuman segar, sampai kue aneka rasa. Nah untuk hidangan utamanya, biasanya kita mengidam-ngidamkan makanan yang lezat, gurih dan nikmat, apalagi setelah melewati masa sebulan puasa. Hidangan yang selalu dicari: Nasi Kare Ayam.', 'header', 'asset/7206438777455a0b4a25f13a9b1907fe9aac7c5298a4fb8f7305600e8f36c5181.png', 'asset/7206438777455a0b4a25f13a9b1907fe9aac7c5298a4fb8f7305600e8f36c518.png', '2022-04-26 16:54:35', 'https://pandangarden.com/', '2022-04-29 00:00:00', '2030-04-29 00:00:00', 'A26', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (110, 'ATC-517BE8026', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Gurihnya Nasi Kare Ayam, bikin ketagihan! (Footer)', 'Nasi Kare Ayam memiliki tekstur ayam yang empuk, kuahnya yang gurih ber-rempah ditambah hidangan pelengkapnya yang beraneka ragam membuat Nasi Kare Ayam jadi favorit banyak keluarga.', 'HTML', 'Hari lebaran datang, pesan nikmatnya Nasi Kare Ayam kesukaan Anda, hanya di Pandan Garden.', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296711.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a038688529671.jpg', '2022-04-26 16:57:46', 'https://pandangarden.com/', '2022-04-29 00:00:00', '2030-04-29 00:00:00', 'A26', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (111, 'ATC-388BE9843', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Kare Ayam', 'Nasi Kare Ayam memiliki tekstur ayam yang empuk, kuahnya yang gurih ber-rempah ditambah hidangan pelengkapnya yang beraneka ragam membuat Nasi Kare Ayam jadi favorit banyak keluarga.', 'HTML', 'Tekstur ayamnya yang empuk, kuahnya yang gurih ber-rempah ditambah hidangan pelengkapnya yang beraneka ragam membuat Nasi Kare Ayam jadi favorit banyak keluarga. Sebagian memilih menyiapkan sendiri dan memasak, sementara sebagian orang lagi memilih memesan Nasi Kare Ayam dari restoran atau dapur favoritnya.\r\n<br>\r\n<br>\r\nWarung-warung dan restoran yang buka selama pekan lebaran biasanya juga menyediakan pesanan khusus paket Nasi Kare Ayam dalam jumlah besar. Pilihan hidangannya bisa dipesan menurut selera masing-masing. Variannya juga beraneka ragam sehingga rasanya mudah disesuaikan selera. Apapun bentuknya, selalu bikin ketagihan. Karena kemudahan ini, Nasi Kare Ayam dapat dipesan dan dinikmati di rumah dengan cepat.', 'content', 'asset/7206438777455a0b4a25f13a9b1907fe9aac7c5298a4fb8f7305600e8f36c5183.png', 'asset/7206438777455a0b4a25f13a9b1907fe9aac7c5298a4fb8f7305600e8f36c5182.png', '2022-04-26 17:00:55', 'https://pandangarden.com/', '2022-04-29 00:00:00', '2030-04-29 00:00:00', 'A26', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (112, 'ATC-444BE5651', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Ini cerita di balik segarnya Es Cendol!', 'Es cendol terdiri dari bulir-bulir cendol yang menggoda ditenggelamkan ke dalam air es yang dilengkapi gula. Sebagai pelengkap ditambahkan santan, susu, tape, potongan buah nangka bahkan durian.', 'HTML', 'Dari Sabang sampai Merauke, dari Tanah Sunda sampai Banjarnegara, populernya Es Cendol sebagai minuman segar Indonesia patut dibanggakan. Lalu, dari mana asalnya?', 'header', 'asset/51f785226c269cbe99f7bd4cf1c43e2b1935ca22e8479001271c003ee948586d.png', 'asset/51f785226c269cbe99f7bd4cf1c43e2b1935ca22e8479001271c003ee948586d1.png', '2022-04-26 17:07:19', 'https://pandangarden.com/', '2022-04-27 00:00:00', '2030-05-05 00:00:00', 'A27', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (113, 'ATC-174BE7250', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Ini cerita di balik segarnya Es Cendol! (Footer)', 'Es cendol terdiri dari bulir-bulir cendol yang menggoda ditenggelamkan ke dalam air es yang dilengkapi gula. Sebagai pelengkap ditambahkan santan, susu, tape, potongan buah nangka bahkan durian.', 'HTML', 'Lengkapi pilihan Main Course hari ini dengan dessert segar Es Cendol. Pesan sekarang!', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296713.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296712.jpg', '2022-04-26 17:08:55', 'https://pandangarden.com/', '2022-04-27 00:00:00', '2030-05-07 00:00:00', 'A27', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (114, 'ATC-175BE6203', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Es Cendol', 'Es cendol terdiri dari bulir-bulir cendol yang menggoda ditenggelamkan ke dalam air es yang dilengkapi gula. Sebagai pelengkap ditambahkan santan, susu, tape, potongan buah nangka bahkan durian.', 'HTML', 'Menurut sejarah populer, Es Cendol merupakan tradisi asli yang berasal dari Sunda (kini Jawa Barat) dan Banjarnegara (Jawa Tengah). Cendol Sunda terkenal karena warna cendolnya yang berwarna hijau, sedangkan dari Jawa Tengah ada varian cendol berwarna hitam atau biasa disebut Dawet Ireng. Penyajiannya sama: bulir-bulir cendol yang menggoda ditenggelamkan ke dalam air es yang dilengkapi gula. Sebagai pelengkap ditambahkan santan, susu, tape, potongan buah nangka bahkan durian!\r\n<br><br>\r\nJangan tertipu dengan kesederhanaannya. Justru tampilan sederhana itu memberikan sensasi yang mengejutkan. Apapun varian warna dan rasanya, tekstur Es Cendol selalu digemari semua kalangan. Kenyalnya bulir cendol dan segarnya air gula membuatnya lengkap untuk menghilangkan haus sekaligus menunda lapar. Karena ini pula, varian Es Cendol banyak dijual di seluruh Indonesia dengan selera masyarakat setempat.', 'content', 'asset/51f785226c269cbe99f7bd4cf1c43e2b1935ca22e8479001271c003ee948586d2.png', 'asset/51f785226c269cbe99f7bd4cf1c43e2b1935ca22e8479001271c003ee948586d3.png', '2022-04-26 17:10:39', 'https://pandangarden.com/', '2022-04-27 00:00:00', '2030-05-05 00:00:00', 'A27', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (115, 'ATC-289BE8659', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bubur Candil, Bubur Tradisi yang Lezat', 'Bubur Candil yang berarti kenyal, imut atau mungil menggambarkan kandungan Bubur Candil itu sendiri yang berbentuk bola-bola kecil.', 'HTML', 'Masyarakat Jawa pasti tahu Bubur Candil. Apalagi yang rajin mengikuti acara tradisional di lingkungan sekitar, bubur satu ini pasti akrab jadi penganan untuk tamu-tamu yang hadir.', 'header', 'asset/b487926f70147317332b493d3357f2b1931efda035bcf7b5884d3de6835128e21.png', 'asset/b487926f70147317332b493d3357f2b1931efda035bcf7b5884d3de6835128e2.png', '2022-05-12 14:17:41', 'https://pandangarden.com/', '2022-05-12 00:00:00', '2090-12-31 00:00:00', 'A28', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (116, 'ATC-208BE7032', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bubur Candil, Bubur Tradisi yang Lezat (Footer)', 'Bubur Candil yang berarti kenyal, imut atau mungil menggambarkan kandungan Bubur Candil itu sendiri yang berbentuk bola-bola kecil.', 'HTML', 'Bubur Candil dengan rasa aslinya kini tersedia di Pandan Garden. Pesan sekarang! ', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296715.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296714.jpg', '2022-05-12 14:19:35', 'https://pandangarden.com/', '2022-05-12 00:00:00', '2090-12-31 00:00:00', 'A28', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (117, 'ATC-392BE6966', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Bubur Candil', 'Bubur Candil yang berarti kenyal, imut atau mungil menggambarkan kandungan Bubur Candil itu sendiri yang berbentuk bola-bola kecil.', 'HTML', 'Sebagaimana namanya, â€œCandilâ€ yang berarti kenyal, imut atau mungil menggambarkan kandungan Bubur Candil itu sendiri yang berbentuk bola-bola kecil. Nah, ternyata, bola-bola kecil itu dibuat dari campuran tepung ketan yang dicampur kanji, dibentuk kecil kemudian direbus. Nah, setelah matang, teksturnya akan kenyal seperti bola kecil imut.\r\n</br></br>\r\nUntuk bagian kuahnya, bola-bola kecil Bubur Candil direndam dalam campuran santan segar atau matang, lalu ditambahkan karamel gula merah ataupun serbuk gula aren sesuai selera. Daun pandan dengan aroma segar bisa ditambahkan sebagai pelengkap. Sederhana sekali, bukan? Terasa sulit saat anda ingin segera makan! Yup, Pandan Garden jawabannya~', 'content', 'asset/b487926f70147317332b493d3357f2b1931efda035bcf7b5884d3de6835128e23.png', 'asset/b487926f70147317332b493d3357f2b1931efda035bcf7b5884d3de6835128e22.png', '2022-05-12 14:22:39', 'https://pandangarden.com/', '2022-05-12 00:00:00', '2090-12-31 00:00:00', 'A28', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (124, 'ATC-886BE4479', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Renyah Tahu Isi selalu dinanti', 'Tahu Isi termasuk salah satu appetizer yang paling banyak dicari, dan paling laris di pasar jajanan.', 'HTML', 'Ada beberapa jenis appetizer yang disukai semua kalangan alias jajanan sejuta umat, Tahu Isi salah satunya. Kalian juga suka? Kalau iya, suka isi dan bentuknya yang seperti apa?', 'header', 'asset/c3abd2c77414b4f405fc5e6abceda32d5465b50b40028e65e6f17465f347592b1.png', 'asset/c3abd2c77414b4f405fc5e6abceda32d5465b50b40028e65e6f17465f347592b.png', '2022-05-13 09:14:12', 'https://pandangarden.com/', '2022-05-20 00:00:00', '2090-05-20 00:00:00', 'A29', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (125, 'ATC-145BE5233', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Tahu Isi', 'Tahu Isi termasuk salah satu appetizer yang paling banyak dicari, dan paling laris di pasar jajanan.', 'HTML', 'Tahu Isi termasuk salah satu appetizer yang paling banyak dicari, dan paling laris di pasar jajanan. Di daerah manapun, penganan satu ini selalu dicari hampir setiap hari. Tekstur luarnya yang gurih dan isiannya yang beraneka ragam jadi bahan kreasi sendiri. Cara membuatnya pun bisa dipelajari semua orang karena begitu mudah.\r\n<br><br>\r\nPada dasarnya memang Tahu Isi berupa rebusan bihun dan sayuran berbumbu yang dibungkus dengan gorengan tahu. Akan tetapi, bentuknya yang sederhana memunculkan banyak variasi, tergantung siapa yang membuat dan ditujukan untuk siapa yang makan. Tahunya bisa berbentuk segitiga, kotak, bahkan bulat. Sementara isiannya ada yang dari wortel, tauge, sampai daging ayam. Apapun bentuk dan kreasinya, Tahu Isi selalu nikmat disantap, dan tidak cukup hanya satu! Pas untuk berkumpul, makan keluarga atau sekadar jajan.', 'content', 'asset/c3abd2c77414b4f405fc5e6abceda32d5465b50b40028e65e6f17465f347592b3.png', 'asset/c3abd2c77414b4f405fc5e6abceda32d5465b50b40028e65e6f17465f347592b2.png', '2022-05-13 09:15:40', 'https://pandangarden.com/', '2022-05-20 00:00:00', '2090-05-20 00:00:00', 'A29', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (126, 'ATC-254BE4624', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Renyah Tahu Isi Selalu Dinanti (footer)', 'Tahu Isi termasuk salah satu appetizer yang paling banyak dicari, dan paling laris di pasar jajanan.', 'HTML', 'Pilih Appetizer kesukaanmu, termasuk Tahu Isi ini, lalu pesan sekarang!', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296717.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296716.jpg', '2022-05-13 09:16:44', 'https://pandangarden.com/', '2022-05-20 00:00:00', '2090-05-20 00:00:00', 'A29', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (127, 'ATC-831BE3953', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Si pemilik hobi dan masakan kesukaannyaâ€¦', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang.', 'HTML', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang. Selain positif dan menyehatkan, hobi juga bisa menjadi penyebab anda menginginkan masakan yang siap saji dan juga lezat!', 'header', 'asset/495b373c85613376605e68b411963e17ada665daee96a1cf9593e9ec70fc0f6b1.png', 'asset/495b373c85613376605e68b411963e17ada665daee96a1cf9593e9ec70fc0f6b.png', '2022-05-13 09:19:47', 'https://pandangarden.com/', '2022-05-27 00:00:00', '2022-05-27 00:00:00', 'A30', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (128, 'ATC-374BE8183', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Geprek', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang.', 'HTML', 'Si pengunjung perpustakaan nampaknya sedang <i>cengar-cengir</i> saat mendapati Nasi Ayam Geprek tertampang jelas kali ini, <i>hehe</i>. Mengapa demikian? Yaa, karena identik dengan anak kost dan kuliah yang hampir setiap harinya punya <i>chemistry</i> khusus dengan Nasi Ayam Geprek. ðŸ˜€\r\n<br><br>\r\nNgomong-ngomong, buku apa sih yang kira-kira dipinjam si pengunjung perpustakaan yang doyan banget Nasi Ayam Geprek ini? Ehmâ€¦kutebak pasti buku-buku teoritisnya Sigmund Freud ya, <i>haha</i>. Bagi pembaca sekalian yang ingin merasakan menjadi si pengunjung perpustakaan yang happy banget setiap hari ini bisa menunggu jadwal <i>pre-order</i> nya dibuka ya~', 'content', 'asset/495b373c85613376605e68b411963e17ada665daee96a1cf9593e9ec70fc0f6b3.png', 'asset/495b373c85613376605e68b411963e17ada665daee96a1cf9593e9ec70fc0f6b2.png', '2022-05-13 09:21:51', 'https://pandangarden.com/', '2022-05-27 00:00:00', '2090-05-27 00:00:00', 'A30', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (129, 'ATC-561BE4992', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Goreng Gila', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang.', 'HTML', 'Si fotografer jalanan di malam hari agaknya punya hiruk-pikuk dengan Nasi Goreng Gila nih. Makanan yang identik dikonsumsi bukan pada pagi hari ini selalu bisa memilih penggemar kuliner yang loyal dan asyik! Masakan yang dipercaya berasal dari ibukota ini punya cara khusus untuk membuat ide fotografi jalanan jadi lebih hidup!\r\n</br></br>\r\nTanpa perlu khawatir akan ketersediaan Nasi Goreng Gila di setiap waktu, kini semuanya bisa menikmati menu pembuat kenyang ini di segala waktu akhir pekan. Yang sudah mulai kelaparan, tunggu aja menu ini hadir dan siap dipesan~.', 'content', 'asset/c166f819664fdda1ea24e08af481b7978a8d6ca18b07046cf43d9dd6e9d22a2c1.png', 'asset/c166f819664fdda1ea24e08af481b7978a8d6ca18b07046cf43d9dd6e9d22a2c.png', '2022-05-13 09:23:10', 'https://pandangarden.com/', '2022-05-27 00:00:00', '2022-05-27 00:00:00', 'A30', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (130, 'ATC-916BE6180', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Serundeng', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang.', 'HTML', 'Si food hunter, orang yang paling jago pakai banget dalam memilih kuliner di segala situasi dan kondisi. Segala macam kuliner di hampir semua daerah di Indonesia pasti diketahui <i>mas-mas</i> dan <i>mbak-mbak</i> penggemar hobi yang satu ini loh!\r\n</br></br>\r\nSeperti Nasi Ayam Serundeng yang satu ini, menu yang populer di Jawa Barat ini bukan jadi hal asing bagi mereka. Nah, kalian pasti ingin tau juga kan bagaimana citarasa dari Nasi Ayam Serundeng ini? <i>Langsung-sung-sung saja~</i> ditunggu jadwal pre-order nya kak!', 'content', 'asset/142be3effae0930050dfe1ae3dcf5052fcba0eb2ca7ec53ff0cfa5a8a73ecc1c1.png', 'asset/142be3effae0930050dfe1ae3dcf5052fcba0eb2ca7ec53ff0cfa5a8a73ecc1c.png', '2022-05-13 09:24:42', 'https://pandangarden.com/', '2022-05-27 00:00:00', '2090-05-27 00:00:00', 'A30', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (131, 'ATC-234BE9816', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Kare Ayam', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang.', 'HTML', 'Dear pembaca sekalian, penulis bingung siapakah di antara si hobi ngerumpi dan si penunggu bingkisan syukuran yang paling menyukai Nasi Kare Ayam? Jika jawabannya adalah si hobi ngerumpi, sepertinya harus ada revolusi kuliner pada masakan Kare yang banyak ditemui saat ini!\r\n<br><br>\r\nMengapa demikian? Karena Pandan Garden sudah menyediakan Nasi Kare Ayam dalam kotak dengan perpaduan isian yang mudah dikonsumsi sembari ngerumpi ceria. So, tidak ada lagi yang namanya batal ngerumpi karena lapar dan males ribet makan. ðŸ˜€', 'content', 'asset/68a4f1c160cd968a88f882c38663b6d72976460b8b4e629a2956621634c887361.png', 'asset/68a4f1c160cd968a88f882c38663b6d72976460b8b4e629a2956621634c88736.png', '2022-05-13 09:26:03', 'https://pandangarden.com/', '2022-05-27 00:00:00', '2090-05-27 00:00:00', 'A30', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (132, 'ATC-202BE3796', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Si pemilik hobi dan masakan kesukaannyaâ€¦ (footer)', 'Hidup akan jauh lebih berwarna saat hobi menjadi alasan utama untuk menghabiskan waktu luang.', 'HTML', 'Nah, kalian termasuk yang mana? Pesan pilihan masakannya hanya di Pandan Garden ya~', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296719.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a0386885296718.jpg', '2022-05-13 09:27:14', 'https://pandangarden.com/', '2022-05-27 00:00:00', '2090-05-27 00:00:00', 'A30', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (133, 'ATC-301BE2244', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nikmat dan Segarnya Es Kelapa Jelly untuk Anda', 'Cara membuatnya Es Kelapa Jelly yaitu santan kelapa segar, air, gula dan bahan jelly dicampur dengan takaran pas, diaduk kemudian direbus seperti metode pembuatan umumnya.', 'HTML', 'Jika Anda kehabisan ide untuk dessert acara keluarga, sahabat ataupun kolega, atau bosan dengan sajian minuman yang itu-itu saja, maka cobalah: Es Kelapa Jelly khas Pandan Garden.', 'header', 'asset/3d561aa53d189f6a0718dd8f9b4be14c35d3738711ba4e52069bd23c93800aa31.png', 'asset/3d561aa53d189f6a0718dd8f9b4be14c35d3738711ba4e52069bd23c93800aa3.png', '2022-05-13 09:31:02', 'https://pandangarden.com/', '2022-06-03 00:00:00', '2090-06-03 00:00:00', 'A31', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (134, 'ATC-285BE1932', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Es Kelapa Jelly', 'Cara membuatnya Es Kelapa Jelly yaitu santan kelapa segar, air, gula dan bahan jelly dicampur dengan takaran pas, diaduk kemudian direbus seperti metode pembuatan umumnya.', 'HTML', 'Cara membuatnya mudah: Santan kelapa segar, air, gula dan bahan jelly dicampur dengan takaran pas, diaduk kemudian direbus seperti metode pembuatan umumnya. Setelah jelly matang, warna dan teksturnya akan menyerupai kelapa muda asli yang segar. Nah, jelly inilah yang bisa diparut, lalu dijadikan bahan utama dalam segelas Es Kelapa Jelly.\r\n<br><br>\r\nUntuk air dan campuran esnya bisa dipilih sesuai pilihan. Bisa dengan campuran soda dan sirup cocopandan, frambozen ataupun rasa lainnya. Tingkat manis juga bisa disesuaikan sesuai selera Anda. Segelas Es Kelapa Jelly akan memberikan kesan baru dan segar untuk keluarga, teman-teman dan kolega Anda. Karena rasa soal selera, maka isian dan bahan lainnya tentu bisa disesuaikan, dikreasikan dan dikembangkan sendiri. Namun, apabila susah untuk memulainya, pesan aja di Pandan Gardenâ€¦mudah! ðŸ˜€', 'content', 'asset/3d561aa53d189f6a0718dd8f9b4be14c35d3738711ba4e52069bd23c93800aa33.png', 'asset/3d561aa53d189f6a0718dd8f9b4be14c35d3738711ba4e52069bd23c93800aa32.png', '2022-05-13 09:33:00', 'https://pandangarden.com/', '2022-06-03 00:00:00', '2090-06-03 00:00:00', 'A31', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (135, 'ATC-267BE3578', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nikmat dan Segarnya Es Kelapa Jelly untuk Anda (footer)', 'Cara membuatnya Es Kelapa Jelly yaitu santan kelapa segar, air, gula dan bahan jelly dicampur dengan takaran pas, diaduk kemudian direbus seperti metode pembuatan umumnya.', 'HTML', 'Dapatkan Es Kelapa Jelly untuk dessert pilihan Anda, pesan di Pandan Garden sekarang!', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967111.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967110.jpg', '2022-05-13 09:34:24', 'https://pandangarden.com/', '2022-06-03 00:00:00', '2090-06-03 00:00:00', 'A31', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (136, 'ATC-427BE9822', 'supresso.com', 'Blogpost', 3, 'ID', 'Ordo Single Origin di Indonesia', 'Sejak diperkenalkan oleh pemerintah kolonial Belanda pada abad ke-17, perjalanan kopi Indonesia kini semakin maju. Wilayah tanam semakin luas, varian semakin beragam, juga produsennya semakin banyak.', 'HTML', 'Sejak diperkenalkan oleh pemerintah kolonial Belanda pada abad ke-17, perjalanan kopi Indonesia kini semakin maju. Wilayah tanam semakin luas, varian semakin beragam, juga produsennya semakin banyak. Cita rasa kopi Indonesia yang berkarakter kuat membuatnya unik dan bernilai ekonomi tinggi. Menurut data BPS tahun 2020, total produksi kopi di Indonesia mencapai 762 ton dengan nilai ekspor mencapai 809 juta dolar Amerika. Ini rata-rata meningkat setiap tahun dengan respon pasar yang semakin baik, lokal maupun internasional.', 'header', 'asset/ad8653264f24f543cb174827a6734ef6a3e14c00029ae8f9f87c2cc8185b11c11.jpg', 'asset/ad8653264f24f543cb174827a6734ef6a3e14c00029ae8f9f87c2cc8185b11c1.jpg', '2022-05-23 11:21:15', 'https://supresso.com/id/article/', '2022-05-23 00:00:00', '2099-05-23 00:00:00', 'SID-002', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (137, 'ATC-765BE4076', 'supresso.com', 'Blogpost', 3, 'ID', 'Single Origin', 'Sejak diperkenalkan oleh pemerintah kolonial Belanda pada abad ke-17, perjalanan kopi Indonesia kini semakin maju. Wilayah tanam semakin luas, varian semakin beragam, juga produsennya semakin banyak.', 'HTML', 'Beberapa varian kopi asli Indonesia kini dinilai sangat mahal di pasar dunia. Kopi Arabica dari Sumatra Mandheling, Toraja, Aceh, Bali dan Flores makin digemari di Asia, Eropa dan Amerika. Kopi dalam bentuk biji mentah, roasted, sampai ground dan capsule bersaing dengan kopi mahal di banyak negara. Sementara di pasar lokal, kopi Robusta Jawa melengkapi varian Arabica banyak daerah, telah jadi bagian penting dari industri yang terus tumbuh.', 'content', 'asset/ad8653264f24f543cb174827a6734ef6a3e14c00029ae8f9f87c2cc8185b11c13.jpg', 'asset/ad8653264f24f543cb174827a6734ef6a3e14c00029ae8f9f87c2cc8185b11c12.jpg', '2022-05-23 11:23:12', 'https://supresso.com/id/article/', '2022-05-23 00:00:00', '2030-05-23 00:00:00', 'SID-002', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (138, 'ATC-872BE6504', 'supresso.com', 'Blogpost', 3, 'ID', 'Ordo Single Origin di Indonesia (Footer)', 'Sejak diperkenalkan oleh pemerintah kolonial Belanda pada abad ke-17, perjalanan kopi Indonesia kini semakin maju. Wilayah tanam semakin luas, varian semakin beragam, juga produsennya semakin banyak.', 'HTML', 'Ilmu perkebunan, pengolahan sampai manufaktur kopi juga semakin berkembang seiring konsumsi masyarakat yang meningkat. Inovasi pun bermunculan. Gerai-gerai kopi modern dengan konsep ritel bertebaran di berbagai kota, memperkenalkan sajian-sajian kopi yang baru dan inovatif, membuka peluang investasi yang menguntungkan. Saatnya kita menjadikan kopi lebih bernilai, ikut serta dalam industri besar yang membawa komoditas Indonesia mendunia, bersama the one and only Supresso Coffee.', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967113.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967112.jpg', '2022-05-23 11:25:53', 'https://supresso.com/id/article/', '2022-05-23 00:00:00', '2099-05-23 00:00:00', 'SID-002', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (139, 'ATC-793BE1439', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Lapar tidak tertahankan, Tahu Telur siap dipesan!', 'Ada beberapa makanan yang mudah sekali terlintas di benak kita saat mencari hidangan penggugah selera di malam hari, terutama kala lapar melanda.', 'HTML', 'Ada beberapa makanan yang mudah sekali terlintas di benak kita saat mencari hidangan penggugah selera di malam hari, terutama kala lapar melanda. Orang suka mencari makanan penunda lapar yang mudah dijangkau, murah, dan rasanya enak. Tahu Telur salah satunya!', 'header', 'asset/e5408c76b50ef9169dee086da362672e4bceb6cf0ed7107614a6c0b473e4fb321.png', 'asset/e5408c76b50ef9169dee086da362672e4bceb6cf0ed7107614a6c0b473e4fb32.png', '2022-06-09 10:53:03', 'https://pandangarden.com/', '2022-06-10 15:00:00', '2099-06-10 00:00:00', 'A32', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (140, 'ATC-897BE6705', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Tahu Telur', 'Ada beberapa makanan yang mudah sekali terlintas di benak kita saat mencari hidangan penggugah selera di malam hari, terutama kala lapar melanda.', 'HTML', 'Penyajiannya menggugah selera, komposisinya yang unik, teksturnya yang meriah, dan rasanya yang sudah pasti enak! Tahu Telur, andalan siapa saja. Meski kelihatannya sederhana dan bahan-bahannya juga mudah, Tahu Telur menembus selera umum dan memuaskan cita rasa banyak kalangan. Kuliner khas Jawa Timur ini memang banyak dicari pencinta kuliner, terlebih karena kesederhanaannya bisa menghilangkan rasa lapar seketika!\r\n<br><br>\r\nDari penampilannya saja sudah terbayang, tekstur telurnya yang empuk di dalam dan renyah di luar, sayuran taoge yang segar menghiasi potongan-potongan tahu yang disusun di tengah piring. Plus, rasa intinya datang dari siraman bumbu kacang dengan porsi yang pas, nikmat gurih, semuanya jadi seimbang. Sekali sendok Tahu Telur, tiga sampai empat rasa bisa dinikmati sekaligus. Setiap sajiannya selalu memuaskan. Makanan ini juga merakyat karena bisa didapatkan di banyak sudut kota, dari resto hingga lapak kaki lima. Nah, sudah menemukan Tahu Telur andalan di kota kalian?', 'content', 'asset/e5408c76b50ef9169dee086da362672e4bceb6cf0ed7107614a6c0b473e4fb323.png', 'asset/e5408c76b50ef9169dee086da362672e4bceb6cf0ed7107614a6c0b473e4fb322.png', '2022-06-09 10:55:34', 'https://pandangarden.com/', '2022-06-10 17:00:00', '2099-06-10 00:00:00', 'A32', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (141, 'ATC-380BE2256', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Lapar tidak tertahankan, Tahu Telur siap dipesan! (Footer)', 'Ada beberapa makanan yang mudah sekali terlintas di benak kita saat mencari hidangan penggugah selera di malam hari, terutama kala lapar melanda.', 'HTML', 'Kalau belum, nih menu baru Tahu Telur kini sudah hadir, bisa dipesan segera di Pandan Garden!', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967115.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967114.jpg', '2022-06-09 10:57:44', 'https://pandangarden.com/', '2022-06-10 17:00:00', '2090-06-10 00:00:00', 'A32', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (142, 'ATC-773BE4931', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Kemangi, Rice Bowl dengan rasa mewah', 'Penyajiannya terukur dan dilakukan oleh tim dari chef andalan, Ayam Kemangi Rice Bowl kali ini hadir dengan cita rasa khas Pandan Garden yang mewah.', 'HTML', 'Ayam goreng berempah selalu nikmat disajikan dengan semangkok nasi hangat. Apalagi, rasa gurih ayam goreng spesial ini diimbangi dengan sajian beraroma segar dari kemangi. Ya, Nasi Ayam Kemangi kini hadir di Pandan Garden!', 'header', 'asset/a28040b42c222dc4b53a2c4de38b6fa709a2d8c30b04fe401b40a8e33943960c1.png', 'asset/a28040b42c222dc4b53a2c4de38b6fa709a2d8c30b04fe401b40a8e33943960c.png', '2022-06-09 11:18:10', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-17 00:00:00', 'A33', 'Draft', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (143, 'ATC-411BE7451', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Kemangi Rice Bowl', 'Penyajiannya terukur dan dilakukan oleh tim dari chef andalan, Ayam Kemangi Rice Bowl kali ini hadir dengan cita rasa khas Pandan Garden yang mewah.', 'HTML', 'Penyajiannya terukur dan dilakukan oleh tim dari chef andalan, Ayam Kemangi Rice Bowl kali ini hadir dengan cita rasa khas Pandan Garden yang mewah. Kemangi jadi pilihan banyak chef karena aroma segar dan rasanya mengimbangi banyak sajian utama yang kaya rempah, seperti Nasi Ayam Kemangi ini.  Yang jelas, komposisinya selalu menggabungkan rasa gurih dari ayam, manis dari nasi, dan segar dari kemangi. Berbagai bahan pelengkap lain pun ditambahkan agar rasanya lebih kaya.\r\n<br><br>\r\nMencari ide makan siang ataupun makan malam sering kali menguras waktu dan pikiran. Sederhana, tapi kesibukan dan banyak prioritas lainnya bisa membuat kita bingung menentukan pilihan menu makan. Nah, ada banyak pilihan yang bisa dinikmati dari dapur Pandan Garden. Menu ini juga melengkapi lini sajian nikmat dan mewah, hasil kreasi kami, untuk memenuhi kebutuhan makan kalian. Selain Nasi Ayam Kemangi, ada beberapa sajian baru yang akan hadir untuk jadi pilihan. Tunggu, ya!', 'content', 'asset/a28040b42c222dc4b53a2c4de38b6fa709a2d8c30b04fe401b40a8e33943960c3.png', 'asset/a28040b42c222dc4b53a2c4de38b6fa709a2d8c30b04fe401b40a8e33943960c2.png', '2022-06-09 11:19:56', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-17 00:00:00', 'A33', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (144, 'ATC-534BE2294', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Kemangi, Rice Bowl dengan rasa mewah (Footer)', 'Penyajiannya terukur dan dilakukan oleh tim dari chef andalan, Ayam Kemangi Rice Bowl kali ini hadir dengan cita rasa khas Pandan Garden yang mewah.', 'HTML', 'Di Pandan Garden, apapun menu item idamanmu hari ini, siap kami antar. Pesan sekarang.', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967117.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967116.jpg', '2022-06-09 11:21:05', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-17 00:00:00', 'A33', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (145, 'ATC-172BE2605', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Daftar penuh masakan lezat bulan Juni', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap!', 'HTML', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap! Ini dia:', 'header', 'asset/44d9c8709bc0ae8cc1f695c4cfad5ca904312fecacb5091bbd769f742160e4321.png', 'asset/44d9c8709bc0ae8cc1f695c4cfad5ca904312fecacb5091bbd769f742160e432.png', '2022-06-09 11:29:05', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-24 11:28:00', 'A34', 'Draft', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (146, 'ATC-303BE2371', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Goreng Kalasan', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap!', 'HTML', 'Satu sajian ayam goreng yang lagi naik daun, <i>nih</i>: Nasi Ayam Goreng Kalasan. Ayam goreng dengan rempah komplit khas Jawa ini adalah favorit banyak orang, <i>lho</i> sekarang. Rempah bumbu yang dipadu dengan gorengan ayam yang empuk berisi, pas banget dengan nasi hangat, sambal dan lalapan segar.\r\n<br><br>\r\nApa lagi yang ditunggu kalau sudah tersaji begini. Semuanya terasa lengkap apalagi dinikmati bersama orang-orang terdekat. Nasi Ayam Goreng Kalasan cocok untuk kegiatan apa saja dan disantap kapan saja, semua pasti suka. Jaminan rasa dan kualitas sajian dapur Pandan Garden selalu membawa kenikmatan hingga suapan terakhir! Mmmmâ€¦.', 'content', 'asset/44d9c8709bc0ae8cc1f695c4cfad5ca904312fecacb5091bbd769f742160e4323.png', 'asset/44d9c8709bc0ae8cc1f695c4cfad5ca904312fecacb5091bbd769f742160e4322.png', '2022-06-09 11:30:58', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-24 00:00:00', 'A34', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (147, 'ATC-795BE1360', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Dory Salted Egg', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap!', 'HTML', 'Tidak perlu menunggu lama, Nasi Dory Salted Egg hanya butuh sedetik untuk jadi begitu menggiurkan. Aroma, paduan daging dory dan <i>salted egg</i>-nya pas dalam porsi <i>rice bowl</i> yang lengkap. Kombinasi proteinnya cukup untuk energi dan semangatmu seharian. Kombinasi rasanya cukup untuk selera pop yang meriah dan mewah!\r\n<br><br>\r\nNasi Dory Salted Egg kini bisa kamu lewat menu PO bulan Juni ini, siapkan sebagai sajian pas untuk acaramu yang akan datang. Atau, nikmati sendiri di rumah dengan nikmat dan lengkap. Ke depannya, akan makin banyak <i>menu item</i> yang baru dalam kategori serupa dengan Nasi Dory Salted Egg ini. Nantikan ya!', 'content', 'asset/b5055996e4dfe327c1db22d5c45e5e4da451f6fae2a67f78a111ea41174db8391.png', 'asset/b5055996e4dfe327c1db22d5c45e5e4da451f6fae2a67f78a111ea41174db839.png', '2022-06-09 11:33:50', 'https://pandangarden.com/', '2022-06-08 11:33:00', '2090-06-24 00:00:00', 'A34', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (148, 'ATC-299BE3837', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Krengsengan Ayam', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap!', 'HTML', 'Kelezatan sajian Jawa Timur kini bisa kalian pesan di Pandan Garden. Nasi Krengsengan Ayam sudah populer sejak dulu. Apalagi, dedikasi chef kawakan menambah cita rasa mewah ke dalam sajian tradisi yang selalu disukai ini. Siapapun pasti suka, siapapun pasti ingin mencoba. <i>Menu item</i> satu ini akan selalu pas.\r\n<br><br>\r\nMenu krengsengan memang enak, apalagi dipadu dengan sajian ayam rempah khas dapur Pandan Garden. Keseimbangan rasa dan orisinalitasnya yang sudah dikenal sejak dulu bikin Nasi Krengsengan Ayam ini diterima di manapun, dan untuk kegiatan apapun. Tinggal siapkan musik lokal yang syahdu, dan Nasi Krengsengan Ayam bisa dinikmati semua.', 'content', 'asset/d7276b29233ab9e9cd53d2ad67296c4f3c5bb3efd803d0caa1cd6d0247c5093a1.png', 'asset/d7276b29233ab9e9cd53d2ad67296c4f3c5bb3efd803d0caa1cd6d0247c5093a.png', '2022-06-09 11:35:07', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-24 00:00:00', 'A34', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (149, 'ATC-129BE9814', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Nasi Ayam Geprek', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap!', 'HTML', 'Kelihatannya simpel, tapi membuat Nasi Ayam Geprek yang enak itu perlu pemahaman dan <i>skill</i> masak yang baik, <i>lho</i>! Mulai dari tipis-tebalnya balutan bumbu ayam, tingkat kematangan, sampai takaran rempah ayam itu sendirilah yang menjadi kunci membuat Nasi Ayam Geprek yang renyah tahan lama, nikmat dan yang paling penting, bikin ketagihan!\r\n<br><br>\r\nNasi Ayam Geprek, hmmâ€¦. Siapa yang tidak suka? Terlepas dari tingkat kepedasan sambalnya, ayam geprek dalam bentuk apapun selalu diterima dan bikin meriah suasana makan. Di Pandan Garden, spesial sambal dan kombinasi sajiannya bikin Nasi Ayam Geprek ini selalu spesial, porsinya pas dan yang pasti, rasanya selalu bikin kangen. <i>Yyyyummy</i>!', 'content', 'asset/79adb884629e2298008cd2fd417a53492409239ebecd364999c89296f0c8e9b81.png', 'asset/79adb884629e2298008cd2fd417a53492409239ebecd364999c89296f0c8e9b8.png', '2022-06-09 11:36:17', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-24 00:00:00', 'A34', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (150, 'ATC-420BE8015', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Daftar penuh masakan lezat bulan Juni (Footer)', 'Ada banyak sajian lezat yang berempah asli Indonesia. Khusus untuk Juni ini, kami pilihkan 4 menu item yang paling populer, paling enak untuk kalian pesan. Pastinya rasa rempahnya nendang, lezat dan dengan kombinasi rasa yang lengkap!', 'HTML', 'Nah, sekarang tinggal pilih, mana sajian rempah yang kalian pilih kali ini? Yuk pesan!', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967119.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967118.jpg', '2022-06-09 11:37:25', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-06-24 00:00:00', 'A34', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (151, 'ATC-413BE2889', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Hangatnya Mie Godog, menambah semangat', 'Makanan berkuah dan hangat memang selalu dicari saat perut lapar atau hati dan pikiran butuh penyemangat, terlepas dari kesibukan pekerjaan.', 'HTML', 'Cuaca dingin, pekerjaan belum selesai, atau pikiran masih penuh dengan hal-hal yang harus diselesaikan? Cari kehangatan dan kenikmatan yang santai dari semangkuk Mie Godog, bisa jadi penambah semangat yang pas untuk anda hari ini.', 'header', 'asset/7b42d2ecdb8ced2edc12a0d8e50d7495924568fe90135d938dabff719fa4ba751.png', 'asset/7b42d2ecdb8ced2edc12a0d8e50d7495924568fe90135d938dabff719fa4ba75.png', '2022-06-09 11:42:32', 'A35', '2022-06-08 00:00:00', '2090-07-01 11:42:00', 'A35', 'Draft', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (152, 'ATC-288BE3212', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Mie Godog ', 'Makanan berkuah dan hangat memang selalu dicari saat perut lapar atau hati dan pikiran butuh penyemangat, terlepas dari kesibukan pekerjaan.', 'HTML', 'Makanan berkuah dan hangat memang selalu dicari saat perut lapar atau hati dan pikiran butuh penyemangat, terlepas dari kesibukan pekerjaan. Mie Godog salah satunya, selalu diincar kalangan produktif yang waktu kesehariannya banyak dihabiskan untuk bekerja. Saat jam makan tiba, semangkok hangat Mie Godog akan selalu berhasil mengembalikan semangat, menenangkan pikiran dan tentunya, mengenyangkan perut. Isiannya yang beragam juga jadi sumber protein yang penting untuk mengembalikan kebugaran. Tidak heran, Mie Godog jadi salah satu sajian yang paling banyak dipesan di banyak daerah.\r\n<br><br>\r\nTekstur mie-nya yang kenyal dan gurih kuahnya yang kaya rasa, menjadikan Mie Godog salah satu comfort food yang digemari banyak orang. Penyajiannya pun relatif cepat dan mudah, isiannya bisa dipilih dari beraneka ragam bahan: ayam, daging, jamur, bakso, sampai sayuran. Semua demi semangkuk kehangatan yang mengembalikan semangat. Setelah Mie Godog habis, biasanya kita merasakan badan yang segar kembali, pikiran lebih tenang, dan tentunya, perut yang kenyang. Kapanpun jam santapnya, Mie Godog selalu jadi sumber semangat.', 'content', 'asset/7b42d2ecdb8ced2edc12a0d8e50d7495924568fe90135d938dabff719fa4ba753.png', 'asset/7b42d2ecdb8ced2edc12a0d8e50d7495924568fe90135d938dabff719fa4ba752.png', '2022-06-09 11:44:10', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-07-01 00:00:00', 'A35', 'Terbit', NULL, NULL, NULL);
INSERT INTO `blog_article_models` VALUES (153, 'ATC-567BE2720', 'pandangarden.com', 'Blogpost', 3, 'ID', 'Hangatnya Mie Godog, menambah semangat (Footer)', 'Makanan berkuah dan hangat memang selalu dicari saat perut lapar atau hati dan pikiran butuh penyemangat, terlepas dari kesibukan pekerjaan.', 'HTML', 'Nikmati sajian baru Mie Godog sekarang hanya di Pandan Garden.', 'footer', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967121.jpg', 'asset/1834929588dbad7e8617ee72dbec916c38aec423467d2a39ed4a03868852967120.jpg', '2022-06-09 11:45:21', 'https://pandangarden.com/', '2022-06-08 00:00:00', '2090-07-01 00:00:00', 'A35', 'Terbit', NULL, NULL, NULL);
