INSERT INTO `product_models` VALUES (1, '10223', 3, 'Sumatra Mandheling Coffee Beans', 'These Arabica coffee beans are not only rare and rich in history but also one of the highly recognised by gourmet coffee producers in the world. The syrupy, full body of Sumatra Mandheling, combined with its muted acidity, makes an elegant, smooth cup of coffee. A blend of sweet and spicy, exuding an exotic flavour.', 'Floral & Fruity - Sweet & Spicy - Slightly Earthy Undertones', 'supresso', 9, 1, 1, 1, 15.10, '$', 200, 10, 10, 15, '4', 'medium acidity/4', '3', 'good body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, '0', 'Available', '[\"Sumatra-Mandheling-Coffee-Beans-200-1.png\",\"Sumatra-Mandheling-Coffee-Beans-200-2.jpg\",\"Sumatra-Mandheling-Coffee-Beans-200-3.jpg\",\"Sumatra-Mandheling-Coffee-Beans-200-4.jpg\"]', 'active', 'false', NULL, '2022-09-28 07:56:04');
