INSERT INTO `product_models` VALUES (46, '10162', NULL, 'Sumatra Mandheling Rainforest Coffee Beans', 'Considered by many to be the best coffee beans that Sumatra produces, our Rainforest Alliance Certified Sumatra Mandheling Rainforest coffee is packed with sweet floral and fruity flavours, and a spicy aroma that finishes off with a slightly earthy undertone. You can try pairing our Sumatran coffee with sweet and creamy desserts.', 'Floral & Fruity - Sweet - Spicy - Slightly Earthy Undertones', NULL, 8, 1, 2, 1, 15.90, '$', 200, 10, 10, 15, '4', 'medium acidity/4', '3', 'good body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Sumatra-Mandheling-Rainforest-Coffee-benas-200-1.png\",\"Sumatra-Mandheling-Rainforest-Coffee-benas-200-2.png\",\"Sumatra-Mandheling-Rainforest-Coffee-benas-200-3.png\",\"Sumatra-Mandheling-Rainforest-Coffee-beans-200-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:46:04');
INSERT INTO `product_models` VALUES (47, '10157', NULL, 'Java Arabica Organic Coffee Beans', 'One of the best farm-to-cup Indonesian coffee comes from Java. These USDA organic approved beans are grown in high altitude without the use of pesticides, herbicides, or other chemicals. With mild acidity and heavy-body, its flavour is elegantly sweet with a subtle earthiness that lingers on.', 'Delicate Sweetness - Slightly Earthy - Woody & Herbal - Long Aftertastes', NULL, 7, 1, 2, 1, 14.30, '$', 200, 10, 10, 15, '1.5', 'mild acidity/1.5', '3', 'heavy body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Java-Arabica-Organic-Coffee-beans-200-1.png\",\"Java-Arabica-Organic-Coffee-beans-200-2.png\",\"Java-Arabica-Organic-Coffee-beans-200-3.png\",\"Java-Arabica-Organic-Coffee-beans-200-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:46:53');
INSERT INTO `product_models` VALUES (48, '10186', 7, 'Java Drip Coffee', 'Supresso Java Robusta coffee beans are thoroughly wet-processed, kicking off the acidity, drops the body and reduces the earthiness of the cup to a unique sweetness. Its strong malty taste with hints of tobacco notes will give a perfect combination when added with cocoa - great for brewing your delicious mocha.', 'Sweetness - Strong Malty - Tobacco Notes', NULL, 9, 2, 3, 3, 5.10, '$', 50, 12, 7, 14, '0', 'no acidity/0', '3', 'good body/3', 'CITY+ ROAST', '100% ROBUSTA COFFEE', NULL, NULL, 'available', '[\"Java-Coffee-drip-50-1.png\",\"Java-Coffee-drip-50-2.png\",\"Java-Coffee-drip-50-3.png\",\"Java-Coffee-drip-50-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:48:04');
INSERT INTO `product_models` VALUES (49, '10238', NULL, 'Costa Rica Blend Drip Coffee', 'Costa Rican coffees believed to have some of the best coffee flavour profiles in the south and central America. Our medium-bodied drip coffee has a defining hazelnut and almond taste with hints of red apple tones and subtle acidity. Your savoury, hearty breakfast will be a good pairing with our blend.', 'Red Apples - Almonds - Roasted Hazelnut', NULL, 10, 1, 4, 3, 7.30, '$', 50, 12, 7, 14, '3', 'medium acidity/3', '3', 'good body/3', 'FULL CITY', '60% Costa Rican Coffee & 40% Arabica Coffee', NULL, NULL, 'available', '[\"Costa-Rica-drip-1.png\",\"Costa-Rica-drip-2.png\",\"Costa-Rica-drip-3.png\",\"Costa-Rica-drip-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:49:01');
INSERT INTO `product_models` VALUES (50, '10237', NULL, 'Brazilia Blend Drip Coffee', 'Intense nuttiness, low acidity and hints of berry-like flavour that offers an excellent bittersweet chocolate taste, our Brazilia Blend drip coffee is not only perfect on its own. It is also an excellent base for brewing flavoured coffees and cappuccino.', 'Intense Nuttiness - Berry Like - Dark Chocolate', NULL, 10, 1, 4, 3, 6.40, '$', 50, 12, 7, 14, '2', 'low acidity/2', '4', 'heavy body/4', 'FULL CITY', '60% Brazilian Coffee & 40% Arabica Coffee', NULL, NULL, 'available', '[\"Brazilia-Blend-1.png\",\"Brazilia-Blend-2.png\",\"Brazilia-Blend-3.png\",\"Brazilia-Blend-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:49:41');
INSERT INTO `product_models` VALUES (51, '10239', NULL, 'Nanyang Coffee Drip Coffee', 'Our Nanyang Coffee is a favourite of the older generation due to its traditional old-school flavour that delights your palate with every sip reminding you of home. It has a rich and robust aroma that exudes a gentle, bittersweet taste, best paired with your morning kaya or peanut butter toast and half-boiled eggs.', 'Rich & Strong', NULL, 10, 1, 4, 3, 4.40, '$', 50, 12, 7, 14, NULL, NULL, NULL, NULL, 'RICH & STRONG', '100% PURE COFFEE', NULL, NULL, 'available', '[\"Nanyang-Coffee-drip-1.png\",\"Nanyang-Coffee-drip-2.png\",\"Nanyang-Coffee-drip-3.png\",\"Nanyang-Coffee-drip-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:50:24');
INSERT INTO `product_models` VALUES (52, '10153', NULL, 'Luwak Prestige Arabica Drip Coffee', 'Characterised by its velvety and sweet chocolaty-caramel taste profile, Luwak is a rare and exotic coffee that leaves every coffee lover intrigued and typically found on bucket lists around the world. A perfect cup for you if you like your coffee smooth with a clean aftertaste.', 'Chocolaty Caramel - Velvety Sweetness - Clean Aftertastes', '', 6, NULL, 4, 3, 24.90, '$', 50, 12, 7, 14, '1.5', 'mild acidity/1.5', '3', 'heavy body/3', 'FULL CITY ROAST', '100% CIVET ARABICA COFFEE', NULL, '0', 'available', '[\"Luwak-Prestige-Arabica-Coffee-drip-50-1.png\",\"Luwak-Prestige-Arabica-Coffee-drip-50-2.png\",\"Luwak-Prestige-Arabica-Coffee-drip-50-3.png\",\"Luwak-Prestige-Arabica-Coffee-drip-50-4.jpg\"]', 'active', 'false', NULL, NULL);
