INSERT INTO `product_models` VALUES (80, '10392', NULL, 'Gift Set Mug Lampung', 'Well-sought after by the world\'s coffee industry, this Robusta coffee gives off an immense strong-bodied bitter taste with the essence of chocolate, slightly earthy aroma and tobacco undertones. The absence of acidity is Lampung\'s trademark.', 'Chocolaty - Slightly Earthy - Tobacco Notes', NULL, 9, 1, NULL, 1, 56.00, '$', 1600, 35, 17, 13, '0', 'no acidity/0', '5', 'strong body/5', 'CITY+ ROAST', '100% ROBUSTA COFFEE', NULL, NULL, 'available', '[\"Gift-Set-Mug-Lampung-1.jpg\",\"Gift-Set-Mug-Lampung-2.jpg\",\"Gift-Set-Mug-Lampung-3.jpg\"]', 'active', 'false', NULL, '2022-10-04 09:59:18');
INSERT INTO `product_models` VALUES (81, '10400', NULL, 'Gift Set V60 Dripper Peaberry', 'Peaberry is known to be significantly sweeter than other beans because of its exclusive access to the fruit. With delicate fruity fragrance, as well as subtle nutty and herbal character, the medium acidity enveloped in sweetness carries through into the long finish.', 'Fresh Herbal - Fruity Cereal - Sweet & Long Aftertastes', NULL, 9, 1, NULL, 1, 73.00, '$', 1700, 35, 17, 14, '3', 'medium acidity/3', '3', 'good body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Gift-Set-V60-Dripper-Peaberry-1.jpg\",\"Gift-Set-V60-Dripper-Peaberry-2.jpg\",\"Gift-Set-V60-Dripper-Peaberry-3.jpg\"]', 'active', 'false', NULL, '2022-10-04 10:01:33');
INSERT INTO `product_models` VALUES (82, '10396', NULL, 'Gift Set Mug Sumatra Mandheling', 'These Arabica coffee beans are not only rare and rich in history but also one of the highly recognised by gourmet coffee producers in the world. The syrupy, full body of Sumatra Mandheling, combined with its muted acidity, makes an elegant, smooth cup of coffee. A blend of sweet and spicy, exuding an exotic flavour.', 'Floral & Fruity - Sweet & Spicy - Slightly Earthy Undertones', NULL, 9, 1, NULL, 1, 69.00, '$', 1600, 35, 17, 13, '4', 'medium acidity/4', '3', 'good body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Gift-Set-Mug-Sumatra-Mandheling-1.jpg\",\"Gift-Set-Mug-Sumatra-Mandheling-2.jpg\",\"Gift-Set-Mug-Sumatra-Mandheling-3.jpg\"]', 'active', 'false', NULL, '2022-10-04 10:05:22');
INSERT INTO `product_models` VALUES (83, '10393', NULL, 'Gift Set Mug Toraja Kalosi', 'Our Supresso Toraja Kalosi is highly valued among Japan\'s coffee drinkers because of its quality traditional processing, offering multiple layers of flavours that reveal something upon each sip. The heavy-bodied coffee is low in acidity, and its delicate aroma denotes warm spices with a sweet and smooth aftertaste.', 'Warm Spices - Sweet & Smooth Aftertastes', NULL, 9, 1, NULL, 1, 67.00, '$', 1600, 35, 17, 13, '2', 'low acidity/2', '4', 'heavy body/4', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, NULL, '[\"Gift-Set-Mug-Toraja-Kalosi-1.jpg\",\"Gift-Set-Mug-Toraja-Kalosi-2.jpg\",\"Gift-Set-Mug-Toraja-Kalosi-3.jpg\"]', 'active', 'false', NULL, '2022-10-04 10:07:10');
INSERT INTO `product_models` VALUES (84, '10403', NULL, 'Gift Set V60 Dripper Bali Kintamani', 'Grown in the highlands of Kintamani, this coffee has unique characteristics derived from wet processing method, making them slightly sweeter. The mild body of the coffee exudes a clean light and refreshing taste exhibiting a citrusy, fruity finish. It is a must-try for those who do not like the bitter taste.', 'Good Balance - Herbal & Nutty - Lively Acidity - Sweet Citrus Notes', NULL, 9, 1, NULL, 1, 65.00, '$', 1700, 35, 17, 14, '3', 'lively acidity/3', '3', 'mild body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Gift-Set-V60 Dripper-Bali-Kintamani-1.jpg\",\"Gift-Set-V60 Dripper-Bali-Kintamani-2.jpg\",\"Gift-Set-V60 Dripper-Bali-Kintamani-3.jpg\"]', 'active', 'false', NULL, '2022-10-04 10:09:08');
