INSERT INTO `product_models` VALUES (113, '10204', 5, 'Manglayang Coffee Beans', 'Famous for its traditional coffee cultivation that retains its original character and distinctive flavours, our Manglayang Arabica coffee provides a smooth, medium body. The gentle plum acidity flavour it exudes, complements its sweet maple syrup notes, leaving a fruity lingering mouthfeel.', 'Sweet Maple Syrup - Fruity - Acidic Plum', NULL, 9, 1, 1, 1, 14.30, '$', 200, 10, 10, 15, '2.5', 'mild acidity/2.5', '3', 'good body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Manglayang-Coffee-beans-200-1.png\",\"Manglayang-Coffee-beans-200-2.png\",\"Manglayang-Coffee-beans-200-3.png\",\"Manglayang-Coffee-beans-200-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:45:15');
INSERT INTO `product_models` VALUES (114, '10191', 7, 'Java Coffee Beans', 'Supresso Java Robusta coffee beans are thoroughly wet-processed, kicking off the acidity, drops the body and reduces the earthiness of the cup to a unique sweetness. Its strong malty taste with hints of tobacco notes will give a perfect combination when added with cocoa - great for brewing your delicious mocha.', 'Sweetness - Strong Malty - Tobacco Notes', NULL, 9, 2, 1, 1, 10.50, '$', 200, 10, 10, 15, '0', 'no acidity/0', '3', 'good body/3', 'CITY+ ROAST', '100% ROBUSTA COFFEE', NULL, NULL, 'available', '[\"Java-Coffee-beans-200-1.png\",\"Java-Coffee-beans-200-2.png\",\"Java-Coffee-beans-200-3.png\",\"Java-Coffee-beans-200-4.png\"]', 'active', 'false', NULL, '2022-10-04 08:58:19');
INSERT INTO `product_models` VALUES (115, '10236', 6, 'West Java Coffee Beans', 'West Java coffees\' sour flavour is not too dominant yet not too earthy. They have a berry-like, wine taste with a sweet honey aroma that taste great on their own or paired well with dark chocolate desserts that accentuates its flavour. To bring out its earthiness, enjoy it with a hearty brunch made with cheese, mushrooms or bacon.', 'Wine Taste - Berry Like - Sweet Honey', NULL, 9, 2, 1, 1, 10.80, '$', 200, 10, 10, 15, '0', 'no acidity/0', '4', 'heavy body/4', 'CITY+ ROAST', '100% ROBUSTA COFFEE', NULL, NULL, 'available', '[\"West-Java-Coffee-beans-200-1.png\",\"West-Java-Coffee-beans-200-2.png\",\"West-Java-Coffee-beans-200-3.png\",\"West-Java-Coffee-beans-200-4.jpg\"]', 'active', 'false', NULL, '2022-10-04 09:30:47');
