INSERT INTO `product_models` VALUES (144, '10518', NULL, 'Gourmet Collection Assorted Coffee Capsules', 'Previously served only with beans, five of our Gourmet Collection variants are now available conveniently in single serve capsules. Don\'t miss out!', '', '', 2, NULL, 3, 4, 7.50, '$', 30, 8, 3, 16, '', '', '', '', '', '', NULL, '0', 'available', '', 'active', 'false', NULL, NULL);
INSERT INTO `product_models` VALUES (145, '10517', NULL, 'Single Origin Assorted Coffee Capsules', 'Traveling around Indonesia with us has been made easier with our One-Stop-Capsules with ten Single Origin Coffee Variants together in a box! Happy exploring.', '', '', 2, NULL, 3, 4, 14.90, '$', 60, 8, 3, 16, NULL, '', NULL, '', '', '', NULL, '0', 'available', '', 'active', 'false', NULL, NULL);
INSERT INTO `product_models` VALUES (146, '20007', NULL, 'Robusta Bundle (Coffee Beans)', 'Like your Indonesian pour-overs strong and robust? The Robusta bundle consisting of only Single Origin Robusta coffee, is guaranteed to knock you off your feet and keep you alert through your afternoon workday.', NULL, NULL, 9, 1, 1, 1, 28.60, '$', 700, 30, 30, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Available', '[\"Robusta-Bundle-coffee-beans-1.jpg\",\"Robusta-Bundle-coffee-beans-2.jpg\",\"Robusta-Bundle-coffee-beans-3.jpg\",\"Robusta-Bundle-coffee-beans-4.jpg\"]', 'active', 'false', NULL, '2022-10-04 09:05:13');
INSERT INTO `product_models` VALUES (147, '10531', NULL, 'Supresso Gift Box', '0', 'Material : Cardboard with matt lamination Magnetic closure <br><br>Dimension: 320(L) x 165(W) x 110(H) mm  <br><br>Gift Box can hold:<br> Supresso Drip Coffee : 6 boxes <br>or<br> Supresso Capsule Coffee : 9 boxes <br>or<br> Supresso Cooffee Beans 200g : 3 cans <br>or<br> Supresso Ground Coffee : 3 boxes <br>or<br> A varied mixture of the aforementioned products!', '', 1, NULL, 5, NULL, 14.90, '$', 600, 32, 17, 11, NULL, '', NULL, '', '', '', NULL, '0', 'available', '[\"giftbox.png\"]', 'active', 'false', NULL, NULL);
INSERT INTO `product_models` VALUES (148, '10531', NULL, 'Supresso Gift Box', '0', 'Material : Cardboard with matt lamination Magnetic closure <br><br>Dimension: 320(L) x 165(W) x 110(H) mm  <br><br>Gift Box can hold:<br> Supresso Drip Coffee : 6 boxes <br>or<br> Supresso Capsule Coffee : 9 boxes <br>or<br> Supresso Cooffee Beans 200g : 3 cans <br>or<br> Supresso Ground Coffee : 3 boxes <br>or<br> A varied mixture of the aforementioned products!', NULL, 1, NULL, 5, NULL, 0.00, '$', 600, 32, 17, 11, NULL, '', NULL, '', '', '', NULL, '0', 'available', '[\"giftbox.png\"]', 'active', 'false', NULL, '2022-10-03 09:47:43');
INSERT INTO `product_models` VALUES (149, '0', NULL, 'Costa Rica Blend Drip Coffee', 'Costa Rican coffees believed to have some of the best coffee flavour profiles in the south and central America. Our medium-bodied drip coffee has a defining hazelnut and almond taste with hints of red apple tones and subtle acidity. Your savoury, hearty breakfast will be a good pairing with our blend.', 'Red Apples - Almonds - Roasted Hazelnut', '', 10, NULL, 4, 3, 0.00, '$', 50, 12, 7, 14, '3', 'medium acidity/3', '3', 'good body/3', 'FULL CITY', '60% Costa Rican Coffee & 40% Arabica Coffee', NULL, '0', 'available', '', 'active', 'false', NULL, NULL);
INSERT INTO `product_models` VALUES (150, '10397', NULL, 'Gift Set Mug Bali Kintamani', 'Grown in the highlands of Kintamani, this coffee has unique characteristics derived from wet processing method, making them slightly sweeter. The mild body of the coffee exudes a clean light and refreshing taste exhibiting a citrusy, fruity finish. It is a must-try for those who do not like the bitter taste.', 'Good Balance - Herbal & Nutty - Lively Acidity - Sweet Citrus Notes', NULL, 9, 1, NULL, 1, 65.00, '$', 1600, 35, 17, 13, '3', 'lively acidity/3', '3', 'mild body/3', 'FULL CITY ROAST', '100% ARABICA COFFEE', NULL, NULL, 'available', '[\"Gift-Set-Mug-Bali-Kintamani-1.jpg\",\"Gift-Set-Mug-Bali-Kintamani-2.jpg\",\"Gift-Set-Mug-Bali-Kintamani-3.jpg\"]', 'active', 'false', NULL, '2022-10-04 09:20:06');
INSERT INTO `product_models` VALUES (151, '10537', NULL, 'Supresso Ombre Blend', '100% Robusta. A robusta blend consisting of only Indonesian beans roasted to Full City roast. Characterised with no acidity and a strong body, rich choco caramel aftertastes and woody nuttiness in its undertones complete this blend.', 'Rich Choco Caramel - Nutty - Spicy - Sweet Chocolaty', '', 5, NULL, 3, 4, 7.50, '$', 60, 8, 3, 16, '0', 'No Acidity/0', '5', 'Strong Body/5', 'FULL CITY ROAST', '100% Robusta Coffee', NULL, '0', 'available', '', 'active', 'false', NULL, NULL);
INSERT INTO `product_models` VALUES (152, '10536', NULL, 'Supresso Decafeine Blend', 'Teeming with exceptional fragrances alongside hints of caramel and spices, this dark roast coffee is smooth and medium-bodied with delicate acidity, all wrapped in a decaffeinated package.', 'Boldly Roasted - Notes of Caramel & Spices - Delicate Acidity', '', 5, NULL, 3, 4, 7.50, '$', 60, 8, 3, 16, '0.5', 'Light Acidity/0.5', '3', 'Good Body/3', 'DARK ROAST', '100% Arabica Coffee', NULL, '0', 'available', '', 'active', 'false', '2022-09-21 08:06:05', '2022-09-21 08:06:05');
